INSERT INTO `berita` (`id`, `tanggal`, `gambar`, `judul`, `konten`) VALUES
(13, '2016-12-27', '1', 'Download PPT Briefing LKMM-TD XXVII', '<p style="text-align: center; ">Silahkan Download PPT Briefing <a href="http://lkmm-td.petra.ac.id/PPT_Briefing.rar">disini</a>.</p>'),
(14, '2016-12-27', '14', 'Download form kesehatan peserta', '<p>Silakan download form kesehatan peserta <a href="http://lkmm-td.petra.ac.id/form_kesehatan.pdf">disini</a>.</p>'),
(15, '2016-12-27', '15', 'Pendaftaran obat-obatan peserta', '<p>Bagi yang belum mengumpulkan Form Kesehatan bisa dikumpulkan saat hari H :\r\n</p><p>\r\n</p><p>- Shift 1 : Senin, 16 Januari 2016\r\n</p><p>\r\n</p><p>- Shift 2 : Jumat, 20 Januari 2016\r\n</p><p>\r\n</p><p>Shift yang dimaksud di atas adalah shift saat LKMM-TD berlangsung. BUKAN shift briefing.\r\n</p><p>\r\n</p><p>Dan bagi yang merasa belum melengkapi ketentuan yang tertera pada Form Kesehatan (materai, tanda tangan orangtua dsb), bisa melengkapi Form Kesehatannya saat hari H LKMM-TD XXVII berlangsung di pos pendaftaran obat, atau mengumpulkan sekali lagi Form Kesehatan dengan kelengkapannya di pos pendaftaran obat.\r\n</p><p>\r\n</p><p>Jika kalian tidak melengkapi ketentuan yang tertera pada Form Kesehatan dan atau tidak mengumpulkan Form Kesehatan, maka kami selaku panitia dari Divisi Konsumsi dan Kesehatan menganggap Form Kesehatan tersebut tidak sah sehingga kami tidak bertanggung jawab atas kondisi kesehatan kalian saat LKMM-TD XXVII berlangsung.\r\n</p><p>\r\n</p><p>Jika ada pertanyaan mengenai konsumsi dan kesehatan, bisa menghubungi panitia Divisi Konsumsi dan Kesehatan :\r\n</p><p>\r\n</p><p>Dian Suwignyo\r\n</p><p>\r\n</p><p>081232888973\r\n</p><p>\r\n</p><p>BILA ANDA INGIN MENDAFTARKAN OBAT-OBATAN ANDA, SILAHKAN TERLEBIH DAHULU MENDOWNLOAD DAN MEMBACA PROSEDUR PENDAFTARAN OBAT-OBATAN DENGAN MENGKLIK TOMBOL DI BAWAH INI (WAJIB):\r\n</p><p>\r\n</p><p><a href="http://lkmm-td.petra.ac.id/prosedur_pendaftaran_obat.docx">Download Prosedur Pendaftaran Obat</a>\r\n</p><p>\r\n</p><p>Untuk mendownload formulir pendaftaran obat-obatan, silahkan mengklik di bawah ini:\r\n</p><p>\r\n</p><p><a href="http://lkmm-td.petra.ac.id/formulir_pendaftaran_obat.docx">Download Formulir Pendaftaran Obat</a>\r\n</p><p>\r\n</p><p><br></p>'),
(16, '2017-01-03', '16', 'Peraturan Peserta LKMM-TD XXVII', '<span style="text-align: left;"><p><span style="font-weight: bold;">Pasal A (Kehadiran)\r\n</span></p><p>1. Batas keterlambatan 15 menit untuk setiap sesi. Jika peserta terlambat lebih dari 15 menit, maka peserta dianggap tidak mengikuti sesi.</p><p>2. Batas tidak mengikuti sesi maksimal 1 kali, jika tidak mengikuti 2 sesi dianggap tidak lulus.\r\n</p><p>3. Peserta wajib mengikuti seluruh rangkaian acara dari awal sampai akhir.</p><p>4. Jika peserta terlambat lebih dari 15 menit, maka peserta dianggap tidak mengikuti sesi.\r\n</p><p><br></p><p>\r\n</p><p><span style="font-weight: bold;">Pasal B (Barang)\r\n</span></p><p>1. Peserta wajib membawa KTM.\r\n</p><p>2. Peserta wajib mengenakan keplek peserta.\r\n</p><p>3. Peserta wajib membawa barang sesuai daftar yang telah ditentukan.\r\n</p><p>4. Peserta dilarang membawa barang di luar daftar barang bawaan wajib dan opsional.\r\n</p><p>5. Peserta bertanggung jawab terhadap barang bawaan masing  masing.\r\n</p><p>6. Panitia berhak untuk menyita barang yang tidak sesuai dengan ketentuan.\r\n</p><p>7. Barang bawaan dimasukkan ke dalam tas ransel / selempang.</p><p><br></p><p>\r\n</p><p>\r\n</p><p><span style="font-weight: bold;">Pasal C (Kelancaran Acara)\r\n</span></p><p>1. Peserta wajib memberikan tanda pengenal ketika meninggalkan ruang sesi (Jika ke toilet memberikan kartu toilet yang disediakan oleh fasilitator).\r\n</p><p>2. Peserta wajib menjaga ketenangan.\r\n</p><p>3. Peserta wajib memperhatikan pembicara.\r\n</p><p>4. Peserta dilarang melakukan aktivitas lain yang dapat menganggu kelancaran acara.\r\n</p><p>5. Peserta dilarang tidur selama sesi berlangsung.\r\n</p><p>6. Peserta dilarang makan dan minum selama sesi berlangsung (kecuali saat di kelas, sebatas air putih dan permen).\r\n</p><p>7. Peserta dilarang menggunakan lift.</p><p><br></p><p>\r\n</p><p>\r\n</p><p><span style="font-weight: bold;">Pasal D (Penampilan)\r\n</span></p><p>1. Pria\r\n</p><p> Rambut rapi (rambut belakang tidak mengenai kerah baju, rambut samping tidak menutupi telinga, rambut depan tidak melebihi alis)\r\n</p><p> Hanya boleh memakai pomade / wax\r\n</p><p> Kuku pendek dan tidak berwarna\r\n</p><p> Tidak diperkenankan memakai aksesoris\r\n</p><p>2. Wanita\r\n</p><p> Rambut rapi diikat tunggal ke belakang (ikat rambut polos tanpa aksesoris)\r\n</p><p> Rambut depan tidak melebihi alis (bila melebihi diikat ke belakang)\r\n</p><p> Make up yang diperkenankan hanya bedak, pensil alis, dan lipbalm\r\n</p><p> Kuku pendek dan tidak berwarna\r\n</p><p> Tidak diperkenankan memakai aksesoris</p><p><br></p><p>\r\n</p><p>\r\n</p><p><span style="font-weight: bold;">Pasal E (Pakaian)\r\n</span></p><p>1. Memakai pakaian standar LKMM-TD\r\n</p><p> Jas almamater\r\n</p><p> Kemeja putih polos dengan kerah segitiga\r\n</p><p> Celana panjang hitam dengan model pipa (kain katun)\r\n</p><p>2. Pemakaian kemeja\r\n</p><p> Kancing kemeja maksimal terbuka satu dari atas\r\n</p><p> Kemeja dimasukkan\r\n</p><p> Kemeja lengan panjang dilinting\r\n</p><p> Kemeja tidak ketat dan tidak tembus pandang\r\n</p><p> Boleh memakai kaos dalam dengan warna senada\r\n</p><p>3. Pemakaian jas almamater\r\n</p><p> Dikancingkan\r\n</p><p> Tidak dilipat atau dilinting\r\n</p><p> Pin fakultas disematkan di sebelah kiri jas almamater\r\n</p><p>4. Boleh memakai ikat pinggang.\r\n</p><p>5. Memakai sepatu sneakers / kets.\r\n</p><p>6. Memakai kaos kaki.</p><p><br></p><p>\r\n</p><p>\r\n</p><p><span style="font-weight: bold;">Pasal F (Sikap)\r\n</span></p><p>1. Peserta wajib menghargai, menghormati dan bersikap kooperatif dengan semua pihak yang terlibat dalam pelaksanaan LKMM-TD.\r\n</p><p>2. Peserta wajib menggunakan bahasa yang baik dan sopan (tidak berkata kotor).</p><p><br></p><p>\r\n</p><p>\r\n</p><p><span style="font-weight: bold;">Pasal G (Kebersihan)\r\n</span></p><p>1. Peserta wajib menjaga kebersihan area LKMM-TD.\r\n</p><p>2. Peserta wajib menjaga dan memelihara fasilitas universitas dan properti LKMM-TD.</p><p><br></p><p>\r\n</p><p>\r\n</p><p><span style="font-weight: bold;">Pasal H (Anarkis)\r\n</span></p><p>1. Peserta dilarang membawa NAPZA, miras, rokok, dan senjata tajam.\r\n</p><p>2. Peserta dilarang berkelahi, berjudi, mencuri, dan berbuat asusila.</p></span>'),
(17, '2017-01-03', '17', 'Jadwal shift per jurusan LKMM-TD XXVII', '<center>\n          </center><table class="table table-bordered table-striped" style="text-align: center;">\n<thead>\n            <tr>\n              <td><b><center>SHIFT 1 (16-19 Januari 2017)</center></b></td>\n              <td><b>SHIFT 2 (20, 21, 23, 24 Januari 2017)</b></td>\n            </tr>\n          </thead>\n          <tbody>\n            <tr>\n              <td>Teknik Sipil</td>\n              <td>Sastra Inggris</td>\n            </tr>\n            <tr>\n              <td>Teknik Arsitektur</td>\n              <td>ECI</td>\n            </tr>\n            <tr>\n              <td>Teknik Mesin</td>\n              <td>Sastra Tionghoa</td>\n            </tr>\n            <tr>\n              <td>Teknik Otomotif</td>\n              <td>Teknik Elektro</td>\n            </tr>\n            <tr>\n              <td>IBM</td>\n              <td>Teknik Industri</td>\n            </tr>\n            <tr>\n              <td>Manajemen Pariwisata</td>\n              <td>SIB</td>\n            </tr>\n            <tr>\n              <td>Manajemen Pemasaran</td>\n              <td>Teknik Informatika</td>\n            </tr>\n            <tr>\n              <td>Manajemen Keuangan</td>\n              <td>Manajemen Bisnis</td>\n            </tr>\n            <tr>\n              <td>DKV</td>\n              <td>Akuntansi Bisnis</td>\n            </tr>\n            <tr>\n              <td>Digital Media</td>\n              <td>IBAcc</td>\n            </tr>\n            <tr>\n              <td>Ilmu Komunikasi</td>\n              <td>Akuntansi Pajak</td>\n            </tr>\n            <tr>\n              <td>PGSD</td>\n              <td>Manajemen Perhotelan</td>\n            </tr>\n            <tr>\n              <td></td>\n              <td>Desain Interior</td>\n            </tr>\n          </tbody>\n\n        </table>'),
(20, '2017-01-08', '20', 'Pengumuman untuk seluruh mahasiswa lama', '<p>Untuk Mahasiswa lama bergabung mengikuti jadwal sesuai dengan prodi masing - masing.<br></p><p>Terima Kasih.<br></p>'),
(25, '2017-01-10', '25.png', 'Barang Bawaan Wajib LKMM-TD XXVII Tanggal 16 - 19 Januari 2017 ( Shift 1 ) dan Tanggal 20 - 23 Januari 2017 ( Shift 2 )', '<p><span style="font-weight: bold;">WAJIB INDIVIDU :\r\n</span></p><p><span style="font-weight: bold;">1. Buku Acara ( Sebagai keplek ) :\r\n</span></p><p><span style="font-weight: bold;">- DOWNLOAD BUKU ACARA di website LKMM-TD XXVII ( http://lkmm-td.petra.ac.id/ ).\r\n</span></p><p><span style="font-weight: bold;">- BUKU ACARA diprint di kertas Art Paper ukuran A3 dengan berat 150 gr.\r\n</span></p><p><span style="font-weight: bold;">- BUKU ACARA dimasukkan dalam name tag lemas ukuran B5, dengan ukuran sekitar ( 17,5 X 25,0 cm ) atau ( 11,5 x 19,5 cm ).\r\n</span></p><p><span style="font-weight: bold;">- NAME TAG LEMAS diikat dengan TALI KUR berwarna putih dengan panjang 1 meter.\r\n</span></p><p><span style="font-weight: bold;">- BUKU ACARA diberi identitas dan ditempel foto 3x4 ( foto formal &amp; berwarna ).<br>\r\n<img src="/main/images/1.jpg"><br>\r\n</span></p><p><span style="font-weight: bold;">\r\n</span></p><p><span style="font-weight: bold;">2. Kartu Tanda Mahasiswa ( KTM ).\r\n</span></p><p><span style="font-weight: bold;">3. Binder WGG / binder bebas ukuran A5.  \r\n</span></p><p><span style="font-weight: bold;">4. 1 buah Flashdisk ( Diberi: Nama + NRP + Nama Kelompok ).\r\n</span></p><p><span style="font-weight: bold;">5. Kotak Pensil ( bukan bahan kaleng ) berisi minimal :\r\n</span></p><p><span style="font-weight: bold;">- 1 buah bolpoin.\r\n</span></p><p><span style="font-weight: bold;">- 1 buah tip-ex.\r\n</span></p><p><span style="font-weight: bold;">- 1 buah penggaris plastik ukuran 15cm.\r\n</span></p><p><span style="font-weight: bold;">6. Botol Minum berukuran 1,5 liter :\r\n</span></p><p><span style="font-weight: bold;">- BOTOL MINUM diikat dengan tali rafia warna hitam.\r\n</span></p><p><span style="font-weight: bold;">- Label merek botol minum dilepas.\r\n</span></p><p><span style="font-weight: bold;">- BOTOL MINUM diberi: Nama + NRP + Nama Kelompok.</span></p><p><span style="font-weight: bold;">7. Membawa 1 buah payung / jas hujan.</span></p><p><span style="font-weight: bold;">\r\n</span></p><p><span style="font-weight: bold;">\r\n</span></p><p><span style="font-weight: bold;">WAJIB KELOMPOK :\r\n</span></p><p><span style="font-weight: bold;">1. 1 buah Kabel Roll :<br>\r\n<img src="/main/images/2.jpg"><br>\r\n</span></p><p><span style="font-weight: bold;">- Terminal berisi minimal 3 stop kontak.\r\n</span></p><p><span style="font-weight: bold;">- Diberi: Nama +NRP + Nama Kelompok.\r\n</span></p><p><span style="font-weight: bold;">2. Minimal 2 Laptop dan Charger Laptop :\r\n</span></p><p><span style="font-weight: bold;">- Diberi: Nama + NRP + Nama Kelompok.\r\n</span></p><p><span style="font-weight: bold;">3. 2 pak permen dengan rasa yang berbeda ( tidak boleh permen karet dan yupi ).\r\n</span></p><p><span style="font-weight: bold;">\r\n</span></p><p><span style="font-weight: bold;"><br></span></p><p></p>'),
(26, '2017-01-10', '26', 'Barang Bawaan Optional LKMM-TD XXVII', '<p>\n    1. Sapu tangan.\n</p>\n<p>\n    2. Tissue kering / basah.\n</p>\n<p>\n    3. 1 buah jas hujan atau payung kecil lipat.\n</p>\n<p>\n    4. Kunci tanpa gantungan atau aksesoris.\n</p>\n<p>\n    5. Pembalut ( dibungkus dengan menggunakan koran ).\n</p>\n<p>\n    6. Kacamata, lap kacamata, dan tempat kacamata standar.\n</p>\n<p>\n    7. Air softlens dan tempat softlens.\n</p>\n<p>\n    8. Jam tangan standar.\n</p>\n<p>\n    9. Domper berisi uang secukupnya.\n</p>\n<p>\n    10. 1 buah handphone.\n</p>\n<p>\n    11. Alat ibadah.\n</p>\n<p>\n    12. Tas laptop dan mouse.\n</p>\n<p>\n    13. Obat-obat pribadi ( sesuai yang terdaftar pada divisi konkes ).\n</p>'),
(28, '2017-01-10', '28', 'Barang Bawaan yang Dikumpulkan Tanggal 16 Januari 2017 ( Shift 1 ) dan Tanggal 20 Januari ( Shift 2 )', '<p>\n    <strong><u>WAJIB INDIVIDU <span style="color: red;">( DIKUMPULKAN )</span> :</u></strong>\n</p>\n<p>\n    1. 1 pak kapas pembalut / pembalut luka dengan ukuran bebas ( kapas yang\n    berserabut, <strong>BUKAN KASA / KAPAS WAJAH </strong>). Dapat dibeli di\n    Apotek.\n</p>\n<p>\n    <img\n        width="171"\n        height="114"\n        src="images/kapas.jpg"\n    />\n</p>\n<p>\n    2. 1 gulung benang wol putih <strong>UKURAN SUPER MILCO</strong>.\n</p>\n<p>\n    <img\n        width="177"\n        height="159"\n        src="images/benang_wol.jpg"\n    />\n    <strong></strong>\n</p>\n<p>\n    <strong>GAMBAR BENANG WOL UKURAN SUPER MILCO.</strong>\n</p>\n<p>\n    <strong>\n        <img\n            width="254"\n            height="168"\n            src="images/gambar_benang.jpg"\n        />\n    </strong>\n    <strong></strong>\n</p>\n<p>\n    <strong><u>WAJIB KELOMPOK <span style="color: red;">( DIKUMPULKAN )</span> :</u></strong>\n</p>\n<p>\n    1. 1 infraboard ukuran A2 warna bebas.\n</p>\n<p>\n    <img\n        width="215"\n        height="121"\n        src="images/infraboard.jpg"\n    />\n</p>\n<p>\n2. 2 botol glitter <strong>BUBUK</strong> silver merk ASTRO atau glitter    <strong>BUBUK </strong>silver minimal 10 gram.\n</p>\n<p>\n    <img\n        width="95"\n        height="148"\n        src="images/glitter.jpg"\n    />\n</p>\n<p>\n    3. 5 batang<strong> REFILL/ISI </strong>lem tembak ukuran besar.\n</p>\n<p>\n    <img\n        width="125"\n        height="125"\n        src="images/lem_tembak.jpg"\n    />\n</p>\n<p>\n    4. 1 isolasi kertas / isolasi bening ( ukuran besar ) :\n</p>\n        - <strong>Isolasi Kertas</strong>\n        yang membawa kelompok 1 - 82 <strong>( SHIFT 1 ) </strong>dan kelompok\n        1 - 85 <strong>( SHIFT 2 )</strong>.\n<p>\n    <img\n        width="131"\n        height="131"\n        src="images/isolasi_kertas.jpg"\n    />\n</p>\n        - <strong>Isolasi Bening</strong>\n        yang membawa kelompok 83 - 164 <strong>( SHIFT 1 ) </strong>dan\n        kelompok 86 - 170 <strong>( SHIFT 2 )</strong>.\n<p>\n    <img\n        width="153"\n        height="153"\n        src="images/isolasi_bening.jpg"\n    />\n</p>\n<p>\n    5. 10 gelas kertas putih ukuran bebas.\n</p>\n<p>\n    <img\n        width="185"\n        height="148"\n        src="images/gelas_kertas.jpg"\n    />\n</p>\n<p>\n    6. 1 buah <strong>TEMPEH BAMBU </strong>dengan diameter 50cm.\n</p>\n<p>\n    <img\n        width="151"\n        height="201"\n        src="images/tempeh.jpg"\n    />\n</p>'),
(29, '2017-01-10', '29', 'Barang Bawaan Kelompok Tanggal 17 Januari 2017 ( Shift 1 ) dan Tanggal 21 Januari 2017 ( Shift 2 )', '<p>\r\n    1. Membawa 2 buah <strong>LEM KERTAS </strong>ukuran kecil.\r\n</p>\r\n<p>\r\n    2. Membawa 1 buah spidol ( boleh lebih ) berwarna hitam dengan ukuran bebas.\r\n</p>\r\n<p>\r\n    3. Membawa 2 buah gunting.\r\n</p>'),
(30, '2017-01-10', '30', 'Barang Bawaan Tanggal 19 Januari 2017 ( Shift 1 ) dan Tanggal 24 Januari 2017 ( Shift 2 )', '<p>\r\n    <strong><u>WAJIB INDIVIDU :</u></strong>\r\n</p>\r\n<p>\r\n    1. Buku Acara ( Sebagai keplek ).\r\n</p>\r\n<p>\r\n    2. Kartu Tanda Mahasiswa ( KTM ).\r\n</p>\r\n<p>\r\n    3. Botol Minum berukuran 1,5 liter.\r\n</p>\r\n<p>\r\n	<strong><span style="color: red;">TIDAK PERLU</span> MEMBAWA BARANG BAWAAN WAJIB KELOMPOK</strong>\r\n</p>\r\n<p align="center">\r\n    <strong><span style="color: red;">TAMBAHAN</span> </strong>\r\n    <strong>\r\n        BARANG BAWAAN WAJIB INDIVIDU TANGGAL 19 JANUARI 2017 ( SHIFT 1 ) DAN\r\n        TANGGAL 24 JANUARI 2017 ( SHIFT 2 )\r\n    </strong>\r\n</p>\r\n<p>\r\n    1. Membawa slayer penutup mata dengan warna gelap.\r\n</p>\r\n<p align="center">\r\n    <strong><span style="color: red;">JANGAN LUPA</span> </strong>\r\n    <strong>\r\n        MENYIAPKAN YEL-YEL KELOMPOK RALLY GAMES TANGGAL 19 JANUARI 2017 ( SHIFT\r\n        1 ) DAN TANGGAL 24 JANUARI 2017 ( SHIFT 2 )\r\n    </strong>\r\n</p>\r\n<p align="center">\r\n    <strong><span style="color: red;">KETENTUAN PEMBUATAN</span> </strong>\r\n    <strong>YEL-YEL DAPAT DILIHAT DI PENGUMUMAN KELOMPOK RALLY GAMES</strong></p><p align="center"><strong><span style="color: rgb(255, 0, 0);">TAMBAHAN</span> UNTUK MAKAN SIANG TERLEBIH DAHULU DI RUMAH.</strong></p>'),
(31, '2017-01-10', '31', 'Pengumuman Kelompok Rally Games', '<p>Silahkan download data kelompok rally games <a href="Kelompok_Rally_Games.xlsx">disini</a></p><p><span style="font-weight: bold; color: rgb(255, 0, 0);">TAMBAHAN</span> UNTUK TANGGAL 19 JANUARI 2017 ( SHIFT 1B ) DAN TANGGAL 24 JANUARI 2017 ( SHIFT 2B ) <span style="color: rgb(255, 0, 0); font-weight: bold;">UNTUK MAKAN SIANG TERLEBIH DAHULU DI RUMAH</span>.</p>\r\n<p align="center"><span style="font-weight: bold;">MEMBUAT YEL  YEL KELOMPOK RALLY GAMES UNTUK TANGGAL 19 JANUARI 2017 ( SHIFT 1A, 1B ) DAN 24 JANUARI 2017 ( SHIFT 2A, 2B )</span></p>\r\n<p>\r\n    1. Ketentuan pembuatan yel-yel <em>Rally Games </em>:\r\n</p>\r\n<p>\r\n    - Tidak menggunakan kata-kata kotor, tidak sopan, menghina dan mengandung\r\n    SARA.\r\n</p>\r\n<p>\r\n- Yel-yel berdurasi <strong>MINIMAL</strong> 10 detik dan    <strong>MAKSIMAL</strong> 1 menit.\r\n</p>\r\n<p>\r\n    - Buatlah yel-yel sekreatif mungkin.\r\n</p>\r\n<p>\r\n    - Yel-yel dibuat untuk kelompok <em>Rally Games.</em>\r\n</p>'),
(32, '2017-01-11', '32', 'Buku Acara LKMM-TD XXVII', '<p>Silahkan download file buku acara <a href="BukuAcara.zip">disini</a></p>\r\n<p>Untuk video tutorial pembuatan buku acara bisa dilihat <a href="https://youtu.be/aDqBTu_Q_LY" target="_blank">disini</a></p>\r\n<p>Ketentuan buku acara bisa dilihat di barang bawaan wajib.</p>'),
(33, '2017-01-11', '33', 'Perubahan Barang Bawaan Wajib Kelompok Tanggal 16 - 18 Januari 2017 ( Shift 1 ) dan Tanggal 20 - 23 Januari 2017 ( Shift 2 )', '<p>Mohon untuk mengecek kembali barang bawaan wajib kelompok karena ada perubahan.</p>'),
