(35, '2017-01-14', '35', 'Pengumuman untuk semua mahasiswa lama shift 1 pada hari keempat', '<p>Semua mahasiswa lama shift 1 pada hari keempat mengikuti shift 1A (shift pagi).<br></p>'),
(37, '2017-01-16', '36', 'Download materi modul 2 (Analisis Kondisi Lingkungan)', '<p>Untuk semua Mahasiswa 2016, Peserta LKMM-TD 2017,<br><br>\r\nFile terlampir berisi KASUS UTAMA untuk keseluruhan LKMM-TD 2017. Silahkan dipelajari dengan baik, sehingga anda memiliki waktu yang cukup untuk memikirkannya terlebih dahulu. Kasus akan mulai dibicarakan sejak hari ke-2.<br><br>\r\n\r\nBiasakan MEMBACA dan PAHAM yang dibaca. \r\nIni kebiasaan yang baik. Lakukan agar 4 hari LKMM-TD ini tidak sia-sia.<br><br>\r\n\r\nPada hari pertama LKMM-TD, anda juga akan dibagikan Buku Modul LKMM-TD. Silahkan modul-modul yang ada didalamnya juga dipelajari baik-baik.<br><br>\r\n\r\nSilahkan klik <a href="Kasus_Utama_LKMM-TD_2017.pdf">di sini</a> untuk mendownload.<br><br>\r\n\r\nSalam,\r\nTim Materi LKMM-TD\r\n<br></p>'),
(38, '2017-01-18', '', 'Pengumuman Tentang Rally Games dan Closing', 'Peserta wajib mengikuti seluruh rangkaian acara rally games dan closing LKMM-TD. Ketidakhadiran akan menyebabkan status kelulusan dipertimbangkan kembali.'),
(39, '2017-01-18', '39', 'Batas Waktu Pengisian Angket Evaluasi', '<p>Karena adanya kendala teknis dalam angket evaluasi pemandu, maka:</p><ol><li>Batas pengisian angket evaluasi pemandu diperpanjang hingga Kamis, 19 Januari 2017 Pukul 23.00 WIB</li><li>Link angket evaluasi akan dikirimkan secara serentak ke email @john masing-masing peserta, mulai Kamis, 19 Januari 2017 Pukul 10.00 WIB</li></ol><p>Demikian pengumuman yang dapat kami sampaikan, mohon maaf atas ketidaknyamanan ini. Tuhan Memberkati</p>'),
