(41, '2017-01-20', '41', 'Perubahan Jam Pulang Hari ke 2 (Shift 2)', '<p>Untuk hari ke - 2 LKMMTD XXVI Shift 2, terdapat perubahan jam pulang, peserta pulang <span style="font-weight: bold;">Pukul 17.30</span>.</p><p><br></p><p>Terima Kasih</p>'),
(42, '0000-00-00', '42', 'Status kelulusan peserta LKMM-TD XXVII', '<p>Status kelulusan peserta LKMM-TD XXVII sudah bisa dilihat di http://student.petra.ac.id/my/board</p>\r\n<p>Protes mengenai kehadiran dan lain-lain diterima maksimal 1 (satu) minggu setelah selesai LKMMTD. Terimakasih</p>\r\n');
