(30, '23416003', 'Lukito Jaya Saputra', 'm23416003@john.petra.ac.id', '', 'Mengenai pembagian Tim', 'Permisi, saya mau tanya apakah tim untuk lkm-td telah fix atau saya dapat mengajukan permohonan untuk pindah tim. Dikarenakan pada tim 90, saya merupakan laki-laki satu-satunya, hal ini cukup menganggu bagi saya. Mohon hal ini dapat ditanggapi. trima kasih.', 0, '2017-01-01 21:20:26'),
