(44, '42416045', 'Wilfredo Theodora Winoto', 'winotowilfredo@gmail.com', '081252407368', 'Anggota Kelompok', 'Halo, saya ingin bertanya mengenai anggota kelompok saya. \r\n\r\nDi kelompok saya, ada seorang mahasiswa bernama Ellysia Tirza dengan NRP 42416021. Sedangkan, di jurusan saya juga ada mahasiswa dengan nama yang sama namun memiliki NRP 42416175. Dan setelah saya cek di grup jurusan saya, hanya ada satu orang mahasiswa yang bernama Ellysia Tirza. Saya sudah mencoba menghubungi mahasiswa tersebut untuk menanyakan NRPnya yang benar, namun tidak kunjung ada jawaban.\r\n\r\nPertanyaan saya, termasuk di kelompok berapakah mahasiswa tersebut? Apa memang mungkin seorang mahasiswa memiliki dua NRP yang berbeda?\r\n\r\nTerima kasih.', 1, '2017-01-03 21:46:01'),
