(64, '22416163', 'Jonathan Prastya Adhi', 'm22416163@john.petra.ac.id', '087787090404', 'Terkait Team LKMM-TD', 'Selamat Siang\r\nSaya mau bertanya mengenai team LKMM-TD saya,  kelompok 127 : Irydomyrmex meridian.\r\n\r\nKetua kelompok saya, Monica Chandra mengatakan bahwa ia tidak bisa mengikuti LKMM-TD tahun ini. \r\nJadi apakah kita sebaiknya menentukan ketua kelompok kita sendiri, atau kita serahkan kembali kepada panitia LKMM-TD untuk menentukan ketuanya.\r\nSekian dan terimakasih.', 1, '2017-01-07 12:53:18'),
