(106, '11414066', 'Edwin Siongkowinarto', 'm11414066@john.petra.ac.id', '0818307732', 'Pertanyaan Mengenai Buku Acara, Barang Bawaan Wajib dan Jadwal Acara', 'Permisi, nama saya Edwin Siongkowinarto (NRP:11414066), mahasiswa shift 2. Jadi, begini, saya ada beberapa pertanyaan: \r\n\r\n1. Tadi saya baca bahwa buku acara bisa di download di website LKMM-TD XXVII, tapi saya agak kesulitan menemukan linknya. Apakah benar link untuk mendownload buku acara ada di http://lkmm-td.petra.ac.id/ ?\r\n\r\n2. Mengenai Barang Bawaan Wajib untuk Tanggal 16 Januari 2017, apakah mahasiswa dari Shift 2 (tanggal 20-21 dan 23-24 Januari 2017) juga harus membawa barang-barang yang sama dengan mahasiswa dari Shift 1? \r\n\r\n3. Mengenai Jadwal Acara, saya sudah melihat jadwal acaranya di PPT Briefing, tapi sepertinya tidak tertulis jam berapa acara dimulai dan jam berapa acara selesai. Kira-kira jam berapa acara dimulai dan acara selesai untuk tanggal 20-21 Januari dan 23-24 Januari 2017? \r\n\r\nTerima Kasih. ', 0, '2017-01-10 10:37:33'),
