(164, '26416119', 'Alexander Thomas', 'm26416119@john.petra.ac.id', '085655880880', 'Barang Bawaan Wajib Kelompok', 'untuk barang bawaan yang dikumpulkan 16 Januari 2017, apakah juga berlaku untuk kelompok shift 2? Jika iya, dikumpulkan kapan? ', 0, '2017-01-10 21:28:00'),
(165, '31416074', 'ivenliane siswanto', 'm31416074@gmail.com', '082132147225', 'pertanyaan ', 'permisi mau tanya download kepleknya dimana ya ? \r\nbarang bawaan yang disuruh tanggal 16 itu dikumpulin buat semua shift atau hanya shift 1 aja \r\nterimahkasih ', 0, '2017-01-10 21:30:45'),
(166, '22416019', 'Mitzy Ghema Susanto', 'mitzyghema@gmail.com', '083831809722', 'Pertanyaan barang bawaan kelompok', 'Jika saya membawa laptop, apakah laptop dan chargernya harus masuk ke dalam tas ransel, atau saya boleh membawa tas terpisah khusus untuk laptop. jika dimasukan ke ransel apakah boleh laptopnya di masukkan ke dalam case laptop? Terimakasih', 1, '2017-01-10 21:54:24'),
