(168, '22416014', 'Dea Agnes', 'deaagnes22@gmail.com', '085852734747', 'pertanyaan mengenai barang bawaan', 'permisi kak, \r\n\r\nsaya ingin menanyakan mengenai barang bawaan\r\napakah tas tersebut diberi keplek untuk identitas? jika iya format identitasnya seperti apa ya?\r\ndan jika tidak muat karena membawa roll kabel, apakah diijinkan membawa kresek/tas tambahan?\r\n\r\nterima kasih kak.', 1, '2017-01-10 22:46:00');
INSERT INTO `contact` (`id`, `nrp`, `nama`, `email`, `telpon`, `subject`, `message`, `status`, `tgl`) VALUES
(169, '22416056', 'Agatha Theodora Christian', 'm22416056@john.petra.ac.id', '082331676862', 'Mengenai peraturan lkmm-td, pasal D ( penampilan )', 'Dalam pasal D, penampilan wanita, poin pertama mengatakan jika rambut diikat rapi tunggal ke belakang dengan ikat rambut polos. Apakah polos itu berarti seperti WGG, harus karet hitam polos? Kemudian saya saya mau menanyakan tentang rambut yang dicat. Dalam peraturan tidak ada yang mengatakan tidak boleh mengecat rambut, di peraturan hanya ada ketentuan tentang kuku yang dicat. berarti rambut yang dicat tidak apa-apa? Terima kasih.', 1, '2017-01-10 23:39:45'),
(170, '31416072', 'Johannes Senders Timesmei Manao', 'johnsenders007@gmail.com', '082234572240', 'pertanyaan barang bawaan', 'apakah barang bawaan tgl 16 juga berlaku untuk yang shift 2 (tgl 20-23)', 0, '2017-01-11 01:51:26'),
(171, '26416089', 'kezia k', 'm26416089@john.petra.ac.id', '085931304001', 'Bertanya mengenai barang bawaan wajib', 'Barang bawaan yang tertulis di powerpoint saat briefing dan yang tercantum di website ini, banyak yang berbeda. Berarti dua-duanya wajib dibawa kah?', 1, '2017-01-11 10:53:12'),
(172, '25416081', 'Stanley Sandjaja', 'm25416081@john.petra.ac.id', '081249880457', 'Ketua Kelompok', 'Kak,saya ingin bertanya apabila ada anggota kelompok yang tidak dapat hadir pada saat LKMM TD yang akan berlansung bagaimana? anggota kelompok yaitu ketuanya sendiri yang tidak dapat hadir, pemilihan ketuanya bagaimana? Terima Kasih', 1, '2017-01-11 11:16:17'),
(173, '21416169', 'Anastasia Winnie Iskandar', 'syawinnie21@gmail.com', '081233126974', 'LKMM-TD', 'selamat siang saya mau bertanya mengenai jadwal lkmm-td yang harus saya ikuti. saya sebelumnya di juruan teknik sipil tetapi melakukan transfer jurusan ke akuntansi pajak tetapi belum mendapatkan nrp baru. saya tetap ikut lkmm-td sesuai jadwal dan kelompok yang sudah ditentukan atau bagaimana? terima kasih.', 1, '2017-01-11 11:39:37'),
(174, '32416041', 'Sheena Santoso', 'sheenasantoso@gmail.com', '082132800947', 'Tanya Ukuran', 'Kalau tempeh bambunya diameter 54cm apa boleh?', 1, '2017-01-11 11:52:20'),
(175, '26416044', 'ivan enrico widodo', 'm26416044@john.petra.ac.id', '085850203356', 'pertanyaan', 'Pada saat lkmmtd boleh membawa kendaraan pribadi? jika boleh, boleh diparkir di lapangan anta?', 0, '2017-01-11 13:02:44'),
(176, '25416007', 'Victor Chiarouven', 'victorchiarouven@yahoo.com', '081235174837', 'Kelompok', 'Bagaimana dengan anggota kelompok yang pindah kampus pada semester 2 ini? karena di kelompok saya ada 1 siswi yang pindah kampus  yaitu , NRP: 31416112 , Nama: DERUSILLA GABRIEL DIAN RACHMAT', 0, '2017-01-11 13:18:46'),
