(179, '42416194', 'Nadya Anindita Wibisono', 'm42416194@john.petra.ac.id', '081231476918', 'Kelompok double', 'Selamat sore. Maaf, saya baru mengetahui kalau nama saya tercantum pada dua kelompok yang berbeda. Saya dengan nrp 42416194(Digital Media) termasuk dalam kelompok 147. Sedangkan nrp saya yang lama, 42416099(DKV), termasuk dalam kelompok 161. Saya sudah tidak menggunakan nrp lama dan selama semester 1 aktif sebagai nrp 42416194. Tolong dicek untuk kelompok 161, karena baru saja ketuanya yang memberitahu saya.\r\nTerima kasih banyak :)', 1, '2017-01-11 20:36:17'),
(180, '32415257', 'Andy William', 'williamzue369@gmail.com', '082231429489', 'buku acara', 'Buku acara di download dimana ya?\r\n', 1, '2017-01-12 13:00:32'),
