(182, '25416081', 'Stanley Sandjaja', 'm25416081@john.petra.ac.id', '081249880457', 'Kelompok', 'Selamat sore kak, saya ingin memberitahu bahwa kelompok saya kekurangan 1 orang. Terima Kasih', 0, '2017-01-12 15:36:54'),
(183, '24416068', 'Christian Edwin Pronk', 'M24416068@john.petra.ac.id', '08117216327', 'Tentang Perizinan', 'Kak, Dikarenakan saya baru saja menjalani operasi dan diharuskan untuk kontrol pada hari selasa tanggal 17 Januari apakah mungkin saya mendapatkan izin. ', 1, '2017-01-12 17:02:09'),
(184, '42416038', 'Erny Ferniaty Anggara Ang', 'm42416038@john.petra.ac.id', '082139822841', 'Tentang binder', 'Selamat malam, mau tolong tanya. Apa ada ketentuan untuk isi binder? seperti harus kertas putih polos bergaris atau boleh berwarna?\r\nberwarna saja, bukan bergambar.. mohon jangan berpikir jika berwarna itu bergambar seperti teman saya -_-', 1, '2017-01-12 21:00:28'),
(185, '34416052', 'Jemmy Tristano', 'jemmytristano@yahoo.co.id', '089699714710', 'Mengenai benang ukuran super milco', 'Permisi kakak - kakak panitia, mengenai barang wajib individu benang wol putih ukuran super milco itu belinya dimana ya(di Surabaya)? saya sudah mencari di beberapa toko benang, namun hasilnya nihil. Saya minta pencerahannya dari kakak - kakak panitia untuk menghimbau informasi tempat dimana saya dapat memperoleh benang wol putih ukuran super milco, terima kasih dan Salam Petra.', 1, '2017-01-12 21:12:22'),
(186, '24416087', 'Yonatan Kristian Adechandra Sarumaha', 'ysarumaha@gmail.com', '08987977003', 'Keplek', 'Mohon maaf,  saya ingin mengkonfirmasi. Apakah informasi ukuran keplek lemas (plastik tag) B5 (176 x 250 cm) sudah benar? Karena sepertinya ada kesalahan ukuran. Bila dalam mm pun masih terlalu besar, dan berbeda dgn contoh yang ada. Mohon penjelasannya. Terimakasih', 1, '2017-01-13 00:08:25'),
(187, '31416183', 'Tiffani Aurelia Tedja Kusuma', 'tiffaurelia08@yahoo.com', '081230556969', 'shift', 'maksudnya shift 2A dan 2B apa ya?', 1, '2017-01-13 08:49:10'),
(188, '24416068', 'christian edwin pronk', 'm24416068@john.petra.ac.id', '082186696763', 'masalah kesehatan', 'selamat siang, saya christian dari jurusan teknik mesin angkatan 2016. beberapa hari yang lalu, saya menjalani operasi angkat pen di bahu kiri. pada hari selasa tanggal 17 januari saya harus check up ke RS di malang. yang ingin saya tanyakan, apakah saya bisa ijin satu hari penuh?\r\njika tidak bisa, tolong berikan nomor telepon yang bisa dihubungi. terimakasih atas perhatiannya.', 1, '2017-01-13 14:10:20'),
(189, '31416017', 'Raynaldi Kweenarto', 'kwenartoraynaldi@yahoo.com', '082338032222', 'Benang wol', 'Cari benang wol ukuran super milco dimana?', 1, '2017-01-13 14:27:10'),
(190, '37416027', 'claudia usmantara', 'claudiausmantara@gmail.com', '081336170074', 'Mengenai Laptop', 'Jika kelompok saya hanya bisa 1 laptop bagaimana ? karena laptopnya yang bisa hanya 1', 1, '2017-01-13 15:11:47'),
