(195, '37416039', 'Devi Kartika', 'm37416039@john.petra.ac.id', '081938547872', 'pendaftaran obat', 'selamat malam, mau menanyakan untuk link prosedur pendaftaran obat beserta link formulir pendaftaran obat kok tidak bisa dibuka ya ? tulisannya page not found, terimakasih', 0, '2017-01-13 20:14:29'),
(196, '22416014', 'Dea Agnes', 'deaagnes22@gmail.com', '085852734747', 'Pertanyaan mengenai benang wol', 'Permisi kak,\r\n\r\nsaya mau tanya mengenai benang wol\r\nbenang wol putih supermilco tersebut dapat dibeli dimana ya kak di surabaya?\r\nsoalnya saya sudah keliling tapi kok belum nemu\r\n\r\nterima kasih kak:)', 1, '2017-01-13 20:27:00'),
(197, '22416014', 'Dea Agnes', 'deaagnes22@gmail.com', '085852734747', 'Pertanyaan format name tag', 'Permisi kak,\r\n\r\nuntuk format nama kelompok dan nrp untuk name tag apakah ada?\r\nseperti ukuran kertasnya berapa kali berapa cm, besar tulisanya berapa cm\r\n\r\nterima kasih kak:)', 1, '2017-01-13 20:31:54'),
(198, '21416154', 'Winston Dassmer', 'm21416154@john.petra.ac.id', '089505346642', 'Barang bawaan kelompok: jumlah laptop', 'apakah barang bawaan kelompok untuk laptop harus minimal 2? saya selaku ketua kelompok sudah menyiapkan 1 buah laptop, akan tetapi untuk anggota kelompok saya (ada 5 org), masing-masing laptopnya bermasalah, ada 2 orang yang memberikan alasan bahwa laptopnya sedang dipakai atau digunakan anggota keluarganya, sedangkan yang 1 beralasan ditinggal di kota asalnya sedangkan dirinya sudah di Surabaya, lalu yang 2 orang lagi menyatakan laptopnya rusak dan sedang diservice. Jadi apa harus 2? atau boleh 1 saja? Karena diawal diminta cukup 1 saja dan ini perubahan juga mendadak tinggal H-beberapa hari lagi. Mohon tanggapannya, Terima kasih GBU.', 1, '2017-01-14 09:57:58'),
(199, '32416030', 'Suryadi Salim', 'm32416030@john.petra.ac.id', '088803202237', 'Barang wajib Permen', 'barang wajib kelompok permen apakah hanya dibawa untuk tanggal 20 saja atau sampai tanggal 24 Januari, dan jika harus di bawa setiap hari apakah harus kemasan baru? terimakasih', 1, '2017-01-14 10:39:15'),
(200, '32416072', 'evania yuniar', 'm32416072@john.petra.ac.id', '081938244887', 'tempeh bambu', 'saya mau bertanya\r\njika tempeh bambu yang ada diameternya tidak pas 50cm, saya beli kurang dari 50 cm (46,5 cm) apakah boleh dibawa? tempeh yang besar mungkin ukuranya lebih dari 50 cm. terima kasih.', 1, '2017-01-14 13:41:47'),
(201, '32416058', 'Jesica Delya Yusha', 'jesica.mopi@gmail.com', '081336829800', 'Pertanyaan', 'kak saya mau bertanya. kelompok really game itu berarti yang ada di file Excel ya? Gabungan dari 2 kelompok LKMM-TD?', 1, '2017-01-14 14:16:27'),
(203, '51416053', 'khong eugenia levina santoso', 'eugenia_levinasantoso@yahoo.co.id', '082137603651', 'tentang benang wol', 'sore kak , saya mau tanya tentang benang wol jika tidak menemukan yang ukuran supermilco apakah boleh ukuran lain ? terima kasih :)', 1, '2017-01-14 17:15:26'),
(204, '22416052', 'Febby Cynthia Liman', 'febbyliman@gmail.com', '087752751297', 'benang wol', 'apakah benar boleh selain ukuran supermilco? tidak adil dong bagi yang sudah beli lagi, supermilco tidak murah, kenapa tidak diberitahu dari awal kalau boleh pakai yang tidak supermilco? thankyou', 0, '2017-01-14 17:45:08'),
(205, '22416019', 'Mitzy Ghema Susanto', 'mitzyghema@gmail.com', '083831809722', 'Ketentuan barang optional', 'apakah ada ketentuan atau peraturan tentang ukuran serta isi dompet selain uang dan ktm?', 1, '2017-01-14 18:41:19'),
(206, '22416019', 'Mitzy Ghema Susanto ', 'mitzyghema@gmail.com', '083831809722', 'Ketentuan barang wajib', 'apa diperbolehkan membawa flashdisk yang ada gantungan aksesorisnya? dikarenakan gantungan tersebut tidak dapat dilepas', 1, '2017-01-14 19:10:12'),
(207, '36416002', 'Andrew Sutanto', 'andrewsutanto1998@gmail.com', '085398042526', 'Pertanyaan mengenai laptop', 'Selamat malam kakak... Saya mau tanya tentang laptop ini, laptop saya tidak punya VGA port untuk presentasi... Jadi saya harus membawa kabel Extender dari HDMI ke VGA... Apakah saya boleh membawa alat tersebut? Saya ingin membawa alat tersebut untuk presentasi nanti, tapi alat tersebut tidak terdaftar dalam barang bawaan wajib maupun optional...', 1, '2017-01-14 20:13:14'),
(208, '35416006', 'Tiffany Evangeline Tanjaya', 'tiffany.evangeline18@gmail.com', '082140212232', 'Barang Bawaan Kelompok', 'Jika dalam 1 kelompok yang bisa membawa laptop hanya 1 orang bagaimana?', 1, '2017-01-14 21:14:11'),
(209, '22416019', 'Mitzy Ghema Susanto', 'mitzyghema@gmail.com', '083831809722', 'Pertanyaan area dropzone', 'Apa ada ketentuan area dropzone? atau diperbolehkan untuk menurunkan penumpang di semua area universitas?', 1, '2017-01-14 22:17:43'),
(210, '36416021', 'Boby Alexander G', 'boby_alexanderg@ymail.com', '081703345999', 'Untuk Barang Bawaan', 'Jika saya tidak punya Flashdisk tapi adanya OTG/Dual USB Drive bagaimana?\r\njika diberi keterangan indentitas , memakai name tag apakah boleh? karena ukuran OTG umumnya kecil\r\nTerima kasih.', 1, '2017-01-15 00:39:43'),
(211, '22416165', 'Bagus Arisanjaya Irawan', 'bagusarisanjaya@yahoo.co.id', '081246076533', 'pertanyaan seputar barang bawaan LKMM-TD', 'selamat pagi, salam sejahtera\r\n\r\nsaya mau bertanya, apakah saya dapat minta izin untuk membawa berkas definitif (Ijazah dan SKHUN) sebagai syarat yang diminta (UK Petra) yang harus saya serahkan ke BAAK? saya akan menyerahkannya bukan pada saat sesi tetapi pada saat jam makan siang. \r\n\r\nterimakasih atas perhatiannya. Tuhan memerkati', 1, '2017-01-15 11:10:52'),
(212, '26416089', 'Kezia K', 'm26416089@john.petra.ac.id', '085931304001', 'Bertanya mengenai sepatu', 'Di website lkmmtd ini, tidak dijelaskan mengenai sepatu berwarna. Apakah itu berarti boleh menggunakan sepatu yang berwarna lain selain hitam? Terima kasih', 1, '2017-01-15 12:38:03'),
(213, '21416229', 'Fransiskus Xaverius Yohanes FO', 'yohanesffx@yahoo.com', '081333336857', 'jam kepulangan', 'mau tanya tanggal 19 itu selesai jam brp ya? soalnya tanggal 19 ada acara keluarga besar ke bali bersama dan sudah dipesankan tiket jam 5 sore.\r\nSHIFT 1A', 1, '2017-01-15 12:38:39'),
(214, '36416052', 'deon sutanto sie', 'deonsutanto@gmail.com', '081250520095', 'kendaraan', 'apakah kita diperbolehkan membawa kendaraan sendiri ?\r\njika boleh, kita kan membawa sim. sedangkan di optional boleh membawa dompet dan membawa uang secukupnya', 1, '2017-01-15 14:25:38'),
(215, '37416018', 'William Setiawan', 'm37416018@john.petra.ac.id', '081249391799', 'Name tag lemas dan tali kur', 'Name tag lemas itu ukurannya agak kebesaran (12x17) boleh tidak?\r\nTali kurnya tidak ada yang putih kalau crem , boleh tidak', 1, '2017-01-15 14:57:53'),
(216, '21416012', 'Christopher Kurniawan', 'm21416012@john.petra.ac.id', '082245651862', 'Pertanyaan tentang barang bawaan', 'Apakah boleh kabel roll diganti dengan sambungan kabel biasa yang berbentuk kotak karena saya bertugas membawa kabel roll dalam kelompok dan baru saja saya coba ternyata rusak. Terima kasih.', 1, '2017-01-15 20:15:45'),
(217, '21416059', 'Artono Tanjung', 'm21416059@john.petra.ac.id', '081232850508', 'Bertanya', 'Apakah saat lkmm-td boleh membawa mobil sendiri? Jika iya, parkir dimana?', 1, '2017-01-15 20:28:04'),
(218, '11416048', 'Vivian Graciela Chertian', 'vgraciela_ch@yahoo.co.id', '081346827075', 'Peraturan untuk Rambut Perempuan', 'Saya punya rambut depan yang melebihi alis, tapi terlalu pendek untuk diikat sehingga hanya bisa diselipkan ke belakang telinga. Agar rambut tetap rapi, apa diperkenankan untuk memakai jepit rambut hitam polos seperti standar WGG atau cukup diselipkan ke belakang telinga? Terima kasih.', 1, '2017-01-15 21:15:23'),
(219, '32416049', 'Michelle', 'm32416049@john.petra.ac.id', '08988999909', 'Ijin kepulangan', 'Apakah bisa bila meminta ijin pulang terlebih dahulu karena ada acara, terima kasih', 1, '2017-01-16 21:31:20'),
(220, '2616061', 'GUNAWAN, NOVITA WATI', 'm26416061@john.petra.ac.id', '081357825557', 'mau bertanya soal kasa pembalut luka', 'saya dapat kasa ukuran kecil dalam 1 plastik itu isinya 5, dibawa semua satu plastik itu (isi 5) atau tetap bawa satu saja dari isi 5 tersebut ?\r\nterima kasih', 1, '2017-01-17 19:38:08'),
(221, '26416061', 'GUNAWAN, NOVITA WATI', 'm26416061@john.petra.ac.id', '081357825557', 'mau bertanya soal kapas pembalut luka (rev)', 'saya mau bertanya soal kapas pembalut luka.\r\nYang saya beli di apotek ini dalam 1 plastik berisi 5 kapas pembalut luka dengan ukuran kecil\r\njadi ini dibawa satu plastik (isi 5) atau hanya bawa satu saja dari isi 5 tersebut ?\r\nterima kasih ', 1, '2017-01-17 19:45:13'),
(1456, '32416097', 'Yosephine Natallina Sudharmono', 'm324169097@john.petra.ac.id', '081931879091', 'Pre tes', 'Saya masih belum bisa mengisi pre tes dan masih belum menerima email padahal nrp saya sudah dicatat\r\nApa yang harus saya lakukan?', 0, '2017-01-21 12:30:22'),
