(1454, '26416190', 'Manusia', 'Antigalau.cg@gmail.com', '0813315691199', 'protest', 'Di peraturan dituliskan harus menggunakan celana katun (cotton) . Tapi kenapa saya pakai celana katun slimfit biasa malah direkap? Saya tidak terima dengn kejadian ini . Jika memang harus menggunakan celan katun halus kenapa tidak dituliskan di buku peraturan dengan jelas !', 0, '2017-01-21 07:29:57'),
