(1451, '31416042', 'Yosua Crispinus Hariyono', 'm31416042@john.petra.ac.id', '08563148076', 'Masalah tidak bisa ngisi post test', 'shalom kak ini saya Yosua Crispinus NRP 31416042 anggota kelompok Meranoplus Rothenyi. Saya mau menyampaikan kalau saya dak bisa ngerjain post testnya kak karena dak bisa masuk ke alamat webnya kak. Saya sudah coba sambungkan hp saya ke wifinya UK PETRA kak tetapi tidak bisa bisa kak hp saya dak bisa nyambung ke wifinya terus saya coba pakai kuota saya sendiri tetap dak bisa kak. Akhirnya karena dak bisa bisa saya terpaksa pulang kak karena sudah ditunggu orang tua saya apalagi cuacanya juga gak bagus hujannya deres. Saya juga sempat minjem hp orang tua saya tetapi tetap aja dak bisa connect kak. Minta tolong kak dibantu solusinya. Terima kasih atas perhatian dan kerja samanya. Saya tunggu kabar baiknya. Tuhan Yesus Memberkati  ', 0, '2017-01-20 20:51:40'),
