(1443, '51416066', 'Sidartha Keanu Liem', 'm51416066@john.petra.ac.id', '081246747894', 'Konfirmasi post-test + Link evaluasi pribadi', 'Mohon maaf sebelumnya, tetapi saya belum dapat e-mail yang berisi konfirmasi bahwa saya sudah menyelesaikan post-test, dan juga e-mail yang berisi link eval yang dikirimkan ke e-mail masing-masing. Apakah bisa dikonfirmasi ulang/diberi tindakan ? Terima kasih', 0, '2017-01-19 21:23:41'),
