(1439, '22416145', 'Dewi Fortuna Putri', 'm22416145@john.petra.ac.id', '081220071742', 'Tidak mendapat konfirmasi setelah mengisi angket', 'Saya sudah mengisi angket evaluasi pada tanggal 18 Januari 2017 yang dikirimkan ke email saya, namun setelah saya mengisi saya tidak mendapat email konfirmasi yang mengatakan saya telah mengisi angket tersebut. Apakah angket yang saya isi benar-benar sudah terkirim atau bagaimana?', 0, '2017-01-19 19:34:04'),
