(1437, '22416021', 'RICHARD CAHYA NUGRAHA', 'm22416021@john.petra.ac.id', '085234742182', 'Postest', 'Saya hanya ingin menanyakan apakah post test yang diberikan hari ini sama dengan yang kemarin atau tidak karena yang kemarin masuk di email saya ada postest tapi yang hari ini belum masuk, padahal tadi di closing dikatakan ada postest. Thanks atas perhatiannya.', 0, '2017-01-19 19:23:39'),
