(1433, '32416086', 'Widyananda Prasetyo', 'm32416086@john.petra.ac.id', '081346693988', 'Perijinan berhalangan mengikuti LKMMTD', 'Bagaimana prosedur perijinan jika berhalangan mengikuti LKMMTD?\r\nApakah harus menyertakan surat ijin apabila berhalangan untuk mengikuti LKMMTD karena alasan kesehatan?\r\n', 1, '2017-01-19 15:47:54'),
(1432, '42416029', 'Ferdiantio Jeremiah Setiawan', 'm42416029@john.petra.ac.id', '082257461529', 'Masalah post test dan angket eval', 'Saya sudah mengisi namun belum dikonfirmasi. Itu juga dialami oleh beberapa teman saya yang sudah mengisi angket dan post test', 0, '2017-01-19 14:46:49'),
(1445, '42416015', 'Gresiana Gede', 'm42416015@john.petra.ac.id', '081333775098', 'Email Konfirmasi', 'selamat malam kak\r\nsaya mau bertanya, ini tentang angkel eval dan postes yang ada di email\r\nsaya kemarin malam sudah mengisi\r\nakan tetapi tidak ada email konfimasi bahwa saya telah mengisi\r\ndan saya juga mengecek di student my board, eval dan postes saya belum diaktifkan.\r\nsaya bingung apa yang harus saya lakukan kak\r\nmohon bantuannya', 0, '2017-01-19 22:39:33'),
(1431, '31416017', 'Raynaldi Kweenarto', 'kwenartoraynaldi@yahoo.com', '', 'Flashdisk', 'Untuk flashdisk kapasitas bebas?\r\nNama, nrp, nama kelompok ditempel atau bagaimana?', 1, '2017-01-19 14:29:25'),
(1447, '24416080', 'Andre Saputra', 'm24416081@john.petra.ac.id', '0895349023521', 'Konfirmasi Pengisian Post Test', 'Selamat siang. Saya mau bertanya, apakah hasil post test saya sudah ada di database?\r\nSaya sudah mengisinya dari hari Rabu, tapi belum mendapat email konfirmasi pengisian. Terima kasih.', 0, '2017-01-20 14:59:23'),
(1430, '31416093', 'Reinaldy H. Wakofan', 'reinaldyharianto@roketmail.com', '081344046195', 'Kekurangan Anggota Lkmmtd', 'Selamat Siang saya mau tanya ini Kelompok LKMM-TD saya kekurangan orang sampai saat ini hanya memiliki 3 orang saja.\r\nKarena 2 anggota yang lain tidak dapat mengikuti LKMM-TD karena bermacam urusan / alasan.\r\nYang menjadi masalah disini, kami (3) anggota lain baru mengetahui hal ini pagi ini. Untuk itu saya baru menghubungi anda saat ini.\r\nMungkin anda sebagai panitia masih berkenan memberikan saya teman kelompok baru, saya akan sangat berterima kasih karena kehadiran anggota baru kedalam kelompok saya akan dapat meringankan beban bawaan kelompok yang begitu banyak dan ribet sekali.\r\nNamun yang menjadi masalah ke 2 adalah bahwa kelompok lain sudah membagi barang bawaannya, jadi jika di pindahkan ke kelompok saya ada kemungkinan ia tidak mau karena nanti kelompok nya akan jadi berantakan.\r\nSaya dan teman kelompok saya yang tersisa sudah berunding dan apakah bisa teman saya yang pindah ke kelompok saya.\r\nSaya sudah berkomunikasi dengan tmn saya dan ia setuju bahwa barang bawaan kelompok nya akan di berikan kepada kelompok nya lalu tmn saya juga bersedia membawa barang bawaan lagi yang di kelompok saya masih menjadi kurang.\r\nJika di perkenankan demikian, tolong hubungin saya untuk konfirmasi.\r\nThankyou. God Bless', 1, '2017-01-19 12:34:03'),
(1448, '33416069', 'Vania Clairine Gunawan', 'vania.clairine60@gmail.com', '082280717181', 'Tidak bisa mengisi pre test ', 'Saya sudah berkali-kali log in tapi tidak berhasil, setiap kali di login dan yang keluar hanya kode-kode seperti kerusakan server. Sehingga tidak bisa dibaca. Mohon panitia memberikan saya bantuan sehingga saya bisa mengerjakan pre test tersebut.', 0, '2017-01-20 19:14:25'),
(1429, '33416026', 'Erica dea hutama', 'ericajongg@gmail.com', '089609233398', 'Tidak dpt hadir karena sakit', 'Sy tidak dpt mengikuti lkmmtd karena sy baru sj bedah gigi graham plg blkg 2 atas dan 2 bwh. Sy bedah skrg karna sakit sekali, dan dokter menganjurkan di bedah segera krna takutnya terkena saraf. Dokter sdh memberi sy surat ijin tp tidak bisa di attach di sini. Klo bisa tolong beritahu sy email address ny biar sy bisa send foto surat ijin dr dokter. Atau bisa kabari sy waktu sdh masuk kuliah utk sy tunjukan surat dr dokterny. \r\n\r\nAtas pengertiannya, sy ucapkan bnyk terimakasih.', 0, '2017-01-19 12:31:06'),
(1428, '22416033', 'Timothy Immanuel', 'timothyimmanuel97@gmail.com', '08993644584', 'Absensi salah', 'Kenapa sesi 15 saya absensinya kosong ya? \r\nPadahal saya belum pernah tidak masuk\r\nTerimakasih', 1, '2017-01-19 12:03:48'),
(1427, '33416134', 'Ichah Mei Ratnasari Tandri ', 'ichatandrii@gmail.com', '081299040621', 'Kapas Pembalut', 'Yang dimaksud "BUKAN KASA" untuk kapas pembalut itu merk Kasa husada ?\r\nSaya sudah ke 4 apotek tapi tidak bisa menemukan kapas pembalut yang mempunyai merk lain kecuali kasa husada. Mereka cuma ada kapas pembalut yang merk Kasa Husada. Gimana ya ini....\r\nTerima Kasih', 0, '2017-01-19 11:40:13'),
(1426, '42416191', 'Yobelin', 'm42416191@john.ac.petra.id', '085608571305', 'Kehadiran', 'Permisi, saya mau bertanya apakah sesi 15 itu? \r\nkarena saya tidak pernah tidak masuk pada saat sesi dan selalu diabsen, namun di student myboard tertera bahwa saya tidak mengikuti sesi tersebut.', 1, '2017-01-19 09:26:28'),
(1425, '22416011', 'Patricia Marissa', 'm22416011@john.petra.ac.id', '081333930063', 'Kesalahan Data Catatan Kehadiran', 'Pada catatan kehadiran saya sesi 15 tertulis x. Padahal, saya hadir pada sesi tersebut. Mohon diperbaiki, terima kasih. ', 1, '2017-01-19 09:03:34'),
(1424, '42416190', 'Debora Christy Rumawas Simona', 'm42416190@john.petra.ac.id', '081237777788', 'Kehadiran', 'Maaf, di student myboard tertulis bahwa saya tidak menghadiri sesi 15 dan 18, sesi 15 itu yang mana ya? Sesi 18 apakah rally games? Soalnya saya dari sesi pertama sampai sesi terakhir kemarin selalu hadir dan sudah diabsen. ', 1, '2017-01-19 08:41:37'),
(1423, '42416190', 'Debora Christy Rumawas Simona', 'm42416190@john.petra.ac.id', '081237777788', 'Angket post test', 'Kemarin malam saya sudah mengisi angket tersebut, namun waktu hendak submit, internet saya error dan webnya loading terus. Saya menunggu lama dan tetap loading, kemarin kondisi tubuh saya memang kurang fit jadi saya ketiduran saat menunggu. Saat saya bangun tadi pagi sekitar jam setengah 8 saya ingat loadingnya belum selesai dan cepat-cepat mengecek halaman tersebut. Takutnya angketnya baru terkirim tadi pagi karena waktu saya buka itu loadingnya baru jalan lalu ganti halaman yang terima kasih sudah mengisi angket. Saya juga tidak mendapat email konfirmasi dari tim materi. Kalau misal terkirimnya tadi  pagi, bagaimana ya? Karena kemarin diumumkan max jam 12 malam. Apakah harus mengulang lkmm-td bila angketnya terlambat mengumpulkan? Terima kasih, Tuhan memberkati.', 0, '2017-01-19 08:22:16'),
(1422, '34416043', 'Sebastian Kornelius', 'sebastiancornelius37@hotmail.com', '085931107244', 'Tadi File Anggaran dan Presentasi Lupa Ganti Nama', 'Pagi, jadi saya tadi sudah kirim email dari email m34416043@gmail.com mengirim file ber-subject "PROPOSAL SHIFT 1 KELOMPOK 40". isi dari email tersebut adalah yang tadi diminta di emailkan (file ppt, anggaran, dan proposal), filenya sudah benar, hanya saja mohon maaf lupa saya ganti format penamaannya untuk file ptp dan anggaran (file proposalnya sudah dengan format Proposal_Shift1_40), apakah saya harus mengirimkannya lagi atau apakah kepanitiaan sudah mengganti nama formatnya sendiri? Terima Kasih dan Mohon Maaf atas kesalahannya  ', 0, '2017-01-19 01:31:59'),
