(1413, '42416137', 'Lisa Febrina Wiarta', 'm42416137@john.petra.ac.id', '082164000428', 'angket eval', 'Saya Lisa dari program studi dkv ingin menanyakan bagaimana saya mengisi angket evaluasi jika sampai saat ini saya belum mendapat link nya? Saya juga sudah mengisi angket Post-test dan hal tersebut sudah diberi email pengonfirmasian, tetapi di student my board statu angket Post test saya masih belum diaktifkan.', 0, '2017-01-18 21:53:47'),
(1414, '51416052', 'FLORENCIA FORTUNA SAPUTRA', 'm51416052@john.petra.ac.id', '081703944121', 'Mengenai konfirmasi partisipasi pengisian post test dan angket eval', 'Selamat malam, saya ingin menanyakan tentang masalah post test. Saya telah mengisi post test namun tidak mendapat email mengenai konfirmasi partisipasi pengisian post test. Dan di email saya belum ada angket eval untuk diisi. Apa yang harus saya lakukan? Terima kasih.', 0, '2017-01-18 21:56:34'),
(1415, '42416138', 'Renata Rizky Dwiputri', 'm42416138@john.petra.ac.id', '87864432330', 'email angket eval', 'ingin memberitahukan bahwa saya belum mendapatkan email angket eval, dan hanya mendapatkan email post-test saja, jadi hanya menerima 1 email saja. terima kasih', 0, '2017-01-18 22:11:20'),
(1457, '32416097', 'Yosephine Natallina Sudharmono', 'me_yosephine@yahoo.co.id', '081931879091', 'Masalah pre tes', 'Saya belum sempat megisi pre tes karena sama sekali tidak bisa dibuka.Saya sudah ke meja trouble dan nrp saya sudah dicatat tapi saya tidak menerima emai apa-apa.\r\nHari selanjutnya saya sudah bertanya lagi  dan nrp saya dicatat dan mau di email tapi saya tidak menrima apa2.\r\nTerus saya sudah menghubungi contact us 3x tapi belum dibalas\r\n', 0, '2017-01-23 07:28:59'),
(1458, '41416002', 'Gracia Ika Gunawan', 'grace.ika.g@gmail.com', '081340212881', 'Post-test LKMM-TD', 'Malam. Tadi saya sudah mengisi post-test buat LKMM-TD, cuma tadi waktu saya tekan tombol submit ngga bisa, jadi saya reload. Tapi diminta token baru. Jadi ini harus gimana ya? Makasih.', 0, '2017-01-23 20:24:40'),
