(1461, '22416028', 'Felicia', 'm22416028@john.petra.ac.id', '08113322104', 'angket pretest ', 'selamat malam, saya dari peserta LKMM-TD shift 1 ingin menanyakan, tadi saya cek studentmyboard saya dan tertulis bahwa saya belum mengisi angket pre-test, padahal saya sudah mengisinya. apakah data pretest saya memang belum masuk atau laman web studentmyboard memang belum diperbarui? terima kasih.', 1, '2017-01-24 20:24:44'),
(1462, '34416003', 'Michael Gunawan', 'm34416003@john.petra.ac.id', '08113449120', 'Data Nilai Berubah', 'Data nilai di student my board berubah, nilai pretest saya sebelumnya 21, sekarang tulisannya belum diisi. Terus melihat kelulusan di mana ya? Katanya saat closing shift 2, saya dari shift 1. Mohon penjelasan dan bantuannya, terima kasih. ', 1, '2017-01-25 03:39:27'),
(1463, '22416163', 'Jonathan Prastya Adhi', 'jonathanpa06@gmail.com', '087787090404', 'Student Myboard', 'Selamat pagi kakak kakak panitia.\r\nSaya Jonathan Prastya Adhi, dari jurusan Teknik Arsitektur.\r\n\r\nPada saat LKMM-TD saya mengikuti shift satu sepenuhnya, saya juga tidak terlambat untuk mengisi angket pre test dan post test. Saat LKMM-TD berlangsung, saya juga sering membuka website Student Myboard untuk mengecek kehadiran saya. Saya ingat, saat itu tanggal 17 Januari 2017 saya mengecek Student Myboard dan saya sudah mengisi angket pre-test dengan score 25 point. \r\nTetapi sekarang saat saya mengecek ulang di Student Myboard, dikatakan bahwa saya belum mengisi angket pre-test.\r\n\r\nMohon penjelasan dan konfirmasi dari pihak panitia. \r\nTerimakasih. ', 1, '2017-01-25 09:14:34'),
(1468, '24416014', 'Owen Stanpo', 'owen.stanpo@gmail.com', '087703212006', 'Nilai LKMM-TD', 'Kak, kok nilai LKMM-TD gak bisa dilihat? Sama dianggap belum mengisi pre-test. Padahal di e-mail sudah ada email konfirmasi sudah menyelesaikan pre-test', 1, '2017-01-26 11:56:55'),
(1467, '34416003', 'Michael Gunawan', 'm34416003@john.petra.ac.id', '08113449120', 'Data Nilai Berubah', 'Nilai pengisian angket saya tiba-tiba hilang, awalnya dapat 21 sekarang tulisannya belum diisi. Terus melihat kelulusannya di mana ya? Katanya bisa dilihat saat closing shift 2, saya dari shift 1. Mohon penjelasan dan bantuannya, terima kasih.', 1, '2017-01-26 04:03:02'),
(1466, '35416033', 'Jevin Wanandy', 'm35416033@john.petra.ac.id', '081229800398', 'Complain tentang Student MyBoard', 'Kenapa isi pre-test saya ditulis "belum di isi" padahal saya sudah isi pre testnya, dan sebelum"nya saya sudah melihat bahwa angket pre test saya sudah keluar dan ada nilai 12, lalu hari ini saya cek ulang kenapa tidak ada data dan ditulis seperti ini "belum di isi" ???\r\nMohon bantuannya, terima kasih!', 1, '2017-01-25 21:09:08'),
(1465, '24416046', 'chandra tri dharmawan', 'm24426046@jhon.petra.ac.id', '082245645672', 'pre test', 'saya sudah mengisi pre test tapi kok tidak masuk', 1, '2017-01-25 18:31:26'),
(1464, '32416049', 'Michelle', 'm32416049@john.petra.ac.id', '08988999909', 'Angket', 'Apakah mengisi angket diwajibkan? Karena saya belum sempat isi, terima kasih', 0, '2017-01-25 10:14:04'),
(1397, '22416118', 'cindy widjaya', 'cindy.9d_4@yahoo.com', '081326616695', 'pemberitahuan ketidakhadiran', 'selamat siang, saya cindy dari jurusan arsitektur. pada hari ini saya tidak bisa masuk mengikuti LKMMTD di karenakan oma saya telah meninggal. bagaimana cara saya memberikan surat atau ijin tidak masuk ini? terima kasih ,', 0, '2017-01-18 13:40:10'),
(1398, '51416067', 'Lita Hendryani', 'm51416067@john.petra.ac.id', '08982392363', 'Angket Evaluasi', 'Saya hanya menerima angket post test', 1, '2017-01-18 18:47:17'),
(1399, '42416113', 'Bella Velisia Sofian', 'm42416113@john.petra.ac.id', '087859560545', 'Survei dan post-test', 'Halo, saya Bella Velisia nrp 42416113 ingin memberi tahu bahwa saya sudah mengisi survei dan post test tetapi tidak terkonfirmasi/saya belum mendapat e-mail konfirmasi. Lalu bagaimana? Terima kasih', 1, '2017-01-18 19:04:16'),
(1400, '42416139', 'Indira Dwi Saputri', 'indira.dwi.saputri@gmail.com', '089607556108', 'Tidak apat email eval ', 'malam ce/ko, aku indira nrp 42416139 belum dapet email buat isi angket eval, makasi ce/ko.', 1, '2017-01-18 19:34:11'),
(1401, '24416033', 'Howard Saputra', 'm24416033@john.petra.ac.id', '085238276660', 'angket evaluasi', 'selamat malam\r\nbisa minta kode token buat angket evaluasi ngga?\r\nkarena tadi sewaktu saya mengisi angket evaluasi, jaringan saya sempat terputus, sehingga harus me-refresh lagi untuk lanjut mengisi angket.\r\ntapi setelah di refresh, saya tidak bisa melanjutkan angket dan diminta untuk mengisi kode token yang baru.\r\nterima kasih', 1, '2017-01-18 19:59:54'),
(1402, '51416056', 'Laurentia Sophie Budiono ', 'sophielaurentia@yahoo.co.id', '081227083797', 'angket eval', 'saya belum menerima email untuk mengisi angket eval LKMTD. Terimakasih ', 1, '2017-01-18 20:09:37'),
(1403, '24416081', 'Andre Saputra', 'm24416081@john.petra.ac.id', '0895349023521', 'Seragam untuk tanggal 19 Januari 2017', 'Selamat malam. Saya mau bertanya apakah seragam untuk tanggal 19 Januari 2017 sama seperti hari-hari sebelumnya atau ada ketentuan lain? Terima kasih.', 1, '2017-01-18 20:14:28'),
(1404, '24416009', 'Kresna Vincent Philbert', 'm24416009@john.petra.ac.id', '089648482035', 'Post test LKMMTD', 'pas post test dibuka isinya : This is a controlled survey. You need a valid token to participate. Jadi gimana ya?', 1, '2017-01-18 20:22:54');
INSERT INTO `contactbalas` (`id`, `idpesan`, `subject`, `balasan`, `tgl`) VALUES
(1, 2, 'Reply:  (LKMM-TD XXVII)', 'Selamat pagi,\r\nMohon maaf, pindah shift tidak diperkenankan karena masalah kapasitas ruangan dan kelompok yang telah ditentukan. Mungkin bisa dijelaskan berhalangan karena alasan apa? Terimakasih, Tuhan memberkati.\r\n\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-05 08:34:55'),
(2, 7, 'Reply: Tanya ttg penampilan rambut (LKMM-TD XXVII)', 'Selamat pagi,\r\nKetentuan warna rambut tidak ditentukan dalam peraturan, mohon dibaca kembali peraturan LKMM-TD.\r\nTerima kasih, Tuhan memberkati.\r\n\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-05 08:37:29'),
(3, 10, 'Reply: Kehilangan ktm (LKMM-TD XXVII)', 'Selamat pagi,\r\nNanti waktu hari H disediakan form pengganti KTM. Jadi bisa digunakan sebagai pengganti.\r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-30 10:11:17'),
(4, 11, 'Reply: mau tanya soal rambut  (LKMM-TD XXVII)', 'Selamat pagi,\r\nUntuk merapikan poni, diperkenankan menggunakan penjepit berwarna hitam polos seperti jepit yang diperbolehkan saat WGG.\r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-30 10:27:33'),
(5, 8, 'Reply: Rambut (LKMM-TD XXVII)', 'Selamat pagi,\r\nYang diperbolehkan hanya pomade/wax. Untuk lebih jelasnya cek di website lkmm-td.petra.ac.id\r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-30 10:36:11'),
(6, 9, 'Reply: Masalah Kelompok (LKMM-TD XXVII)', 'Selamat pagi,\r\nUntuk masalah kelompok dapat dilihat di website lkmm-td.petra.ac.id pada awal januari sekitat tanggal 8. Peserta dihimbau selalu mengecek website untuk melihat pemberitahuan terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n', '2016-12-30 10:48:48'),
(7, 15, 'Reply: tanya (LKMM-TD XXVII)', 'Selamat pagi,\r\nPembagian kelompok LKMM-TD XXVII akan diberitahukan di website lkmm-td.petra.ac.id, pada awal Januari sekitar tanggal 8. Peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-30 10:58:45'),
(8, 18, 'Reply: Pembagian Kelompok (LKMM-TD XXVII)', 'Selamat pagi,\r\nPembagian kelompok LKMM-TD XXVII akan diberitahukan di website lkmm-td.petra.ac.id, pada awal Januari sekitar tanggal 8. Peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-30 10:59:39'),
(9, 13, 'Reply: Penggunaan Kontak Lens (LKMM-TD XXVII)', 'Selamat pagi,\r\nDiperbolehkan, untuk ketentuan warna soflens bebas.\r\n\r\nTerimah kasih, Tuhan memberkati.', '2016-12-30 11:10:53'),
(10, 19, 'Reply: Peraturan lkmm (LKMM-TD XXVII)', 'Selamat pagi, \r\nUntuk ketentuan warna rambut peserta bebas.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-30 11:12:47'),
(11, 14, 'Reply: Berhalangan hadir  (LKMM-TD XXVII)', 'Selamat siang\r\n\r\nMengenai kehadiran/absensi di LKMM-TD, peserta hanya boleh tidak hadir maksimal 1 sesi. \r\n\r\nTerima kasih, Tuhan memberkati', '2016-12-31 10:48:45'),
(12, 27, 'Reply: keplek (LKMM-TD XXVII)', 'Selamat pagi,\r\nUntuk ketentuan keplek akan diumumkan di website lkmm-td.petra.ac.id , peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretariat LKMM-TD XXVII -', '2016-12-31 11:22:25'),
(13, 26, 'Reply: bawaan (LKMM-TD XXVII)', 'Selamat pagi, \r\nBinder yang digunakan berukuran A5 (23 x 18 cm). Kalau bingung dapat menggunakan binder WGG 2016 karena ukurannya sama.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-31 11:29:57'),
(14, 24, 'Reply: softlens (LKMM-TD XXVII)', 'Selamat siang,\r\nPeserta diperbolehkan menggunakan soflens berwarna, disarankan menggunakan soflens berwarna gelap(coklat atau hitam) dan diperbolehkan membawa peralatan soflens seperti yang dicantumkan di barang bawaan optional ppt briefing LKMM-TD XXVII.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretatiat LKMM-TD XXVII-', '2016-12-31 11:33:54'),
(15, 21, 'Reply: Informasi team (LKMM-TD XXVII)', 'Selamat siang,\r\nTerima kasih atas info yang telah diberikan. Jumlah anggota kelompok masih mencukupi apabila masih berjumlah 5 orang.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-31 11:40:07'),
(16, 20, 'Reply: Kelompok (LKMM-TD XXVII)', 'Selamat pagi,\r\nUntuk menghubungi kelompok dapat mengirim email ke NRP anggota kelompok anda.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-31 11:43:05'),
(17, 22, 'Reply: Nrp tidak terdaftar  (LKMM-TD XXVII)', 'Selamat sore,\r\nPanitia sudah mengecek dan ternyata sudah terdaftar, mohon dicoba lagi Clarissa.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\n-Sekretariat LKMM-TD XXVII-', '2016-12-31 15:45:51'),
(18, 25, 'Reply: jam mulai dan selesai (LKMM-TD XXVII)', 'Selamat sore,\r\nJam masuk peserta jam 7.00 WIB setiap harinya, khusus hari ke empat ada 2 shift, shift A pukul 7.00 WIB dan shift B pukul 11.30 WIB. \r\n\r\n', '2016-12-31 15:54:16'),
(19, 17, 'Reply: Berhalangan hadir di tanggal 21januari (LKM', 'Selamat siang\r\n\r\nMengenai peraturan kehadiran LKMM-TD, batas ketidakhadiran hanyalah 1 sesi saja maksimal. Selebihnya akan mempengaruhi kelulusan. \r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-31 16:00:33'),
(20, 23, 'Reply: Mau tanya  (LKMM-TD XXVII)', 'Selamat siang\r\n\r\nMengenai jam mulai dan berakhir kegiatan LKMM-TD setiap harinya tidak sama dan tergantung pembagian shift, lebih lengkapnya akan diinformasikan lebih lanjut melalui website pada waktu dekat ini.\r\n\r\nTerima kasih, Tuhan memberkati', '2016-12-31 16:02:37'),
(21, 16, 'Reply: Kehadiran (LKMM-TD XXVII)', 'Selamat sore,\r\nUntuk lama per sesi tidak dapat dipastikan, karena lama setiap sesi berbeda-beda. Bila mau meninggalkan kelas peserta wajib ijin ke sekretariat yang ada di setiap gedung. \r\n\r\nTerima kasih, Tuhan memberkati.', '2016-12-31 16:29:30'),
(22, 28, 'Reply: anggota kelompok kurang dari 5 orang (LKMM-', 'Selamat pagi,\r\n\r\nTerima kasih atas info yang diberikan, jika memungkinkan panitia akan mengatur lagi kelompok supaya pembagian kelompok rata. Peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru dan perubahan. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 09:47:09'),
(23, 32, 'Reply: Download ppt dan form kesehatan (LKMM-TD XX', 'Selamat pagi,\r\n\r\nMohon maaf, kemarin terjadi sedikit gangguan pada server. Silahkan mendownload ulang PPT karena server sudah diperbaiki. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 09:52:41'),
(24, 33, 'Reply: Jumlah anggota kurang (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nMohon maaf, karena gangguan server mungkin waktu itu ada anggota yang namanya tidak muncul. Kelompok 30 sudah beranggotakan 5 orang. Silahkan dicek kembali.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:05:42'),
(25, 35, 'Reply: Masalah Anggota Kelompok (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas info yang diberikan, panitia akan mengatur kembali kelompok yang anggotanya kurang agar pembagiaannya rata. Peserta dihimbau mengecek team kembali setelah tanggal 7 Januari 2017.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:11:03'),
(26, 36, 'Reply: Kendaraan (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nPeserta diperbolehkan untuk membawa kendaraan pribadi.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:12:02'),
(27, 40, 'Reply: Team (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nMohon maaf karena gangguan server mungkin waktu itu ada nama anggota yang tidak muncul. Sekarang server sudah diperbaiki, kelompok 161 terdiri dari 5 orang, silahkan dicek kembali.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:14:22'),
(28, 39, 'Reply: pemberitahuan fix ttg jmlh klmpk yg tdk dap', 'Selamat pagi,\r\n\r\nTerima kasih atas info yang diberikan, panitia akan mengatur kembali kelompok yang anggotanya tidak mencukupi. Silahkan mengecek team kembali setelah tanggal 7 Januari. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:16:31'),
(29, 42, 'Reply: Buku Acara (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nMengenai ketentuan buku acara dan keplek akan diberitahukan diwebsite. Peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:19:20'),
(30, 43, 'Reply: Keplek dan buku acara (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nMengenai ketentuan buku acara dan keplek akan diberitahukan diwebsite. Peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 10:20:09'),
(31, 44, 'Reply: Anggota Kelompok (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nData yg kami dapat Ellysia Tirza memang ada 2 orang. Ellysia Tirza dengan NRP 42416021 yang merupakan anggota kelompok anda. Coba cek di jurusan digital media. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:43:04'),
(32, 44, 'Reply: Anggota Kelompok (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nData yg kami dapat Ellysia Tirza memang ada 2 orang. Ellysia Tirza dengan NRP 42416021 yang merupakan anggota kelompok anda. Coba cek di jurusan digital media. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:43:39'),
(33, 44, 'Reply: Anggota Kelompok (LKMM-TD XXVII)', 'Selamat sore,\n\nData yg kami dapat Ellysia Tirza memang ada 2 orang. Ellysia Tirza dengan NRP 42416021 yang merupakan anggota kelompok anda. Coba cek di jurusan digital media. \n\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:43:46'),
(34, 44, 'Reply: Anggota Kelompok (LKMM-TD XXVII)', 'Selamat sore,\n\nData yg kami dapat Ellysia Tirza memang ada 2 orang. Ellysia Tirza dengan NRP 42416021 yang merupakan anggota kelompok anda. Coba cek di jurusan digital media. \n\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:43:48'),
(35, 44, 'Reply: Anggota Kelompok (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nData yg kami dapat Ellysia Tirza memang ada 2 orang. Ellysia Tirza dengan NRP 42416021 yang merupakan anggota kelompok anda. Coba cek di jurusan digital media. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:43:52'),
(36, 44, 'Reply: Anggota Kelompok (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nData yg kami dapat Ellysia Tirza memang ada 2 orang. Ellysia Tirza dengan NRP 42416021 yang merupakan anggota kelompok anda. Coba cek di jurusan digital media. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:43:36'),
(37, 46, 'Reply: Kendaraan (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nPeserta diperbolehkan membawa kendaraan pribadi.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:44:42'),
(38, 41, 'Reply: Jumlah anggota kelompok (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nAnda salah memasukkan NRP sehingga kami tidak bisa mengecek kelompok anda. Coba di cek kembali di website apakah kelompok anda masih kurang dan silahkan menghubungi kami kembali.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:50:08'),
(39, 47, 'Reply: Pertanyaan (LKMM-TD XXVII)', 'Selamat sore,\r\n\r\nLaptop dipergunakan untuk mengerjakan tugas yang diberikan oleh pemandu seperti power point sehingga memerlukan microsoft.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 17:53:04'),
(40, 38, 'Reply: pelaporan tim kurang dari 5 (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nKelompok anda terdiri dari 6 orang, karena server mengalami gangguan nama 1 anggota anda tidak muncul, yaitu : \r\n\r\nElita Febi Susanto 34416023\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 18:18:35'),
(41, 48, 'Reply: Pertanyaan (LKMM-TD XXVII)', 'Selamat malam, \r\n\r\nLaptop dipergunakan untuk tugas kelompok. Mencukupi, tetapi disarankan jumlah laptop lebih dari 1 untuk berjaga-jaga jika terjadi eror.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 18:21:19'),
(42, 49, 'Reply: Peraturan penampilan (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nPeserta diperbolehkan untuk memakai soflens minus. Disarankan memakai soflens yang berwarna gelap.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-04 18:22:24'),
(43, 50, 'Reply: Ingin bertanya tentang kelompok (LKMM-TD XX', 'Selamat pagi,\r\n\r\nSaran dari kami menghubungi melalui email NRP, misal m26414080@john.petra.ac.id atau mencari di instagram.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-05 10:38:16'),
(44, 51, 'Reply: Barang yg di pakai (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nDiperbolehkan, disarankan soflens berwarna bening atau gelap seperti warna hitam dan coklat tua.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-05 10:40:25'),
(45, 52, 'Reply: sudah lulus lkmmtd (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nJika sudah lulus tidak perlu mengikut LKMM-TD lagi.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-06 08:51:53'),
(46, 53, 'Reply: kelompok kurang (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas infonya, panitia akan mengatur kembali kelompok-kelompok yang anggotanya kurang. Peserta dihimbau selalu mengecek website untuk melihat pengumuman terbaru dan perubahan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-06 08:56:16'),
(47, 54, 'Reply: Pertanyaan (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih untuk konfirmasinya. Kelompok tetap seperti awal, Tuhan memberkati.', '2017-01-07 11:02:31'),
(48, 58, 'Reply: ukuran tempeh (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nJika tidak menemukan boleh memakai yang diameter 47 cm.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-07 11:05:14'),
(49, 60, 'Reply: Buku Acara  (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nSekitar tanggal 7 atau 8 Januari.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-07 11:30:11'),
(50, 57, 'Reply: kelompok <5 org (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas konfirmasinya, anggota kelompok tetap seperti awal. Nama kelompok 58 dan kelompok 57 berbeda.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:09:25'),
(51, 59, 'Reply: Barang Wajib Kelompok (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nBarang bawaan wajib peserta dan barang bawaan wajib kelompok dibawa setiap hari, jika ada barang bawaan wajib kelompok tambahan hanya dibawa pada hari tertentu sesuai ketentuan panitia. Mengenai tempeh apabila tidak bulat 50 cm diperbolehkan jika hanya berbeda beberapa cm.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:13:18'),
(52, 61, 'Reply: Beberapa pertanyaan mengenai lkmm-td (LKMM-', 'Selamat pagi,\r\n\r\nKetentuan mengenai keplek, buku acara dan jadwal akan segera dipublikasikan di website, harap selalu mengecek website. Peserta boleh membawa kendaraan pribadi.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n', '2017-01-08 11:16:14'),
(53, 62, 'Reply: keplek (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nAda ketentuannya, ketentuan keplek akan segera dipublikasikan di website. Harap selalu mengecek website.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:17:33'),
(54, 63, 'Reply: Masalah anggota kelompok (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas konfirmasinya, jika sudah pindah berarti tidak masuk dalam kelompok anda. Nanti saat pelaksanaan LKMM-TD akan diatur lebih lanjut.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:20:55'),
(55, 65, 'Reply: Mau tanya tentang LKMTD (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nForm kesehatan dikumpulkan saat hari pertama LKMM-TD, jam masuk pukul 07.00 WIB.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:23:29'),
(56, 69, 'Reply: Tanya barang lkmmtd (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nMengenai tempeh diperbolehkan jika berbeda beberapa cm. Untuk FD tidak ada ketentuan.', '2017-01-08 11:28:45'),
(57, 70, 'Reply: Buku acara / Keplek (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nKetentuan tentang keplek dan buku acara akan segera dipublikasikan di website, harap selalu mengecek website. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:30:03'),
(58, 71, 'Reply: Jumlah peserta LKMMTD (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas konfirmasinya, tidak masalah jika tersisa 4 orang. \r\n\r\nTuhan memberkati.', '2017-01-08 11:31:45'),
(59, 72, 'Reply: Buku Acara (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nKetentuan tentang keplek dan buku acara akan segera dipublikasikan di website, harap selalu mengecek website.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:32:46'),
(60, 73, 'Reply: pertanyaan (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nKetentuan tentang buku acara akan segera dipublikasikan di website, harap selalu mengeceknya. PPT keamanan ada di PPT briefing LKMM-TD.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 11:34:29'),
(61, 56, 'Reply: A (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nUntuk tempat parkir kendaraan sama seperti saat kuliah sehari-hari.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 15:43:43'),
(62, 64, 'Reply: Terkait Team LKMM-TD (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nMengenai ketua kelompok anda yang baru, anggota kelompok anda dapat memilih senidiri.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 15:50:19'),
(63, 66, 'Reply: Pertanyaan barang bawaan kelompok (LKMM-TD ', 'Selamat pagi,\r\n\r\nPermen 2 pak dibawa setiap hari.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 15:53:13'),
(64, 67, 'Reply: Tas yang dibawa (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nBoleh memakai tas ransel atau tas selempang.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 15:53:57'),
(65, 68, 'Reply: Mau tanya (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nSebagai ketua kelompok anda harus membuat group kelompok anda (line/bbm/WA) untuk berkoordinasi dengan semua anggota kelompok mengenai barang bawaan kelompok dsb.\r\n\r\nTerima kasih, Tuhan memberkati. ', '2017-01-08 15:56:02'),
(66, 74, 'Reply: Pertanyaan (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nKetentuan buku acara dan keplek akan segera dipublikasikan di website, harap selalu mengecek website.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 15:57:13'),
(67, 75, 'Reply: Belum keluar nama kelompoknya (LKMM-TD XXVI', 'Selamat siang,\r\n\r\nTerima kasih atas informasinya, mengenai anggota kelompok tetap sama seperti kelompok awal. Untuk lebih lanjutnya akan diatur kembali saat pelaksanaan sesi di kelas oleh pemandu.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 16:03:52'),
(68, 76, 'Reply: Jadwal LKMMTD (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nJam masuk dan jam pulang peserta LKMM-TD XXVII pukul 7.00-18.00 WIB setiap hari nya, khusus hari ke-4 terbagi menjadi 2 shift.\r\nShift A pukuk 7.00- 13.45 WIB dan shift B pukul 11.30- 18.00 WIB. \r\nJam tersebut masih bisa berubah tergantung kondisi acara saat hari H. Peserta dihimbau selalu mengecek website LKMM-TD XXVII untuk melihat pengumuman terbaru.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-08 16:07:23'),
(69, 78, 'Reply: Tanya (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nJika sudah lulus tidak perlu mengikuti LKMM-TD tahun inu lagi.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 14:46:52'),
(70, 81, 'Reply: Shift Mahasiswa lama Sastra Inggris (LKMM-T', 'Selama siang,\r\n\r\nBagi mahasiswa lama yang mengikuti LKMM-TD tahun ini mengikuti shift sesuai dengan jurusan masing-masing. Jadi anda mengikuti shift 2.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n', '2017-01-11 14:50:50'),
(71, 96, 'Reply: Tanya Tentang Laptop (LKMM-TD XXVII)', 'Selama siang,\r\n\r\nSoftware yang diperlukan microsoft word, microsoft excel dan microsoft power point saja.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:11:09'),
(72, 112, 'Reply: Anggota Kelompok LKMM-TD (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nTerima kasih atas konfirmasinya, kelompok tetap seperti awal. Nanti saat pelaksanaan LKMM-TD akan diatur lebih lanjut dengan pemandu masing-masing ruangan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:20:57'),
(73, 126, 'Reply: pertanyaan (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nPeserta boleh membawa kendaraan pribadi. Mengenai tempat parkir dapat menggunakan tempat-tempat yang biasanya dipakai dalam perkuliahan sehari-hari.\r\n\r\nTerima kasih,Tuhan memberkati.', '2017-01-11 15:25:02'),
(74, 156, 'Reply: Barang bawaan (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nLaptop wajib dibawa dari hari pertama sampai hari ketiga saja. Iya, butuh laptop yang memiliki tempat usb. Tas laptop boleh tas jinjing.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:37:32'),
(75, 161, 'Reply: Seragam Putih (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nKemeja putih polos dengan lengan pendek memang diperbolehkan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:41:45'),
(76, 166, 'Reply: Pertanyaan barang bawaan kelompok (LKMM-TD ', 'Selamat siang,\r\n\r\nBoleh membawa tas laptop.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:46:19'),
(77, 168, 'Reply: pertanyaan mengenai barang bawaan (LKMM-TD ', 'Selamat siang,\r\n\r\nTas tidak perlu diberi keplek. Boleh, tetapi diusahan kabel rol, dll dimasukkan ke dalam tas ransel saja.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:50:17'),
(78, 169, 'Reply: Mengenai peraturan lkmm-td, pasal D ( penam', 'Selamat siang,\r\n\r\nBenar, yang dipergunakan karet hitam polos seperti yang digunakan saat WGG. Mengenai rambut yang dicat tidak apa-apa, sesuai ketentuan yang berlaku.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n', '2017-01-11 15:52:25'),
(79, 171, 'Reply: Bertanya mengenai barang bawaan wajib (LKMM', 'Selamat siang,\r\n\r\nMengenai barang bawaan mengikuti update terbaru di website.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:53:48'),
(80, 172, 'Reply: Ketua Kelompok (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nAnggota kelompok dapat memikih ketua kelompoknya sendiri.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:54:34'),
(81, 173, 'Reply: LKMM-TD (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nTerima kasih atas informasinya. Mengenai kelompok dan prodi mana yang diikuti, anda tetap mengikuti kelompok yang sudah ditetapkan diawal.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 15:57:02'),
(82, 174, 'Reply: Tanya Ukuran (LKMM-TD XXVII)', 'Selama siang,\r\n\r\nBoleh, diusahakan membawa tempeh yang paling mendekati diameter 50 cm.', '2017-01-11 15:58:28'),
(83, 177, 'Reply: Barang bawaan wajib (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nContohnya sudah ada di web.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-11 16:01:54'),
(84, 178, 'Reply: Pertanyaan ketentuan LKMM-TD (LKMM-TD XXVII', 'Selamat pagi,\r\n\r\nTidak ada larangan untuk tempat parkir.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-12 08:58:41'),
(85, 179, 'Reply: Kelompok double (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas konfirmasinya. Anda tetap masuk ke kelompok 147 dengan nrp 42416194(Digital Media).\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-12 10:10:46'),
(86, 180, 'Reply: buku acara (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nBuku acara sudha bisa didownload di web. Harap mengecek web.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-12 16:01:35'),
(87, 181, 'Reply: mau tanya (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nJadwal pelaksanaan LKMM-TD XXVII sudah bisa dilihati di buku acara. Buku acara dapat di download di web.\r\n\r\nTerima kasih Tuhan memberkati.', '2017-01-12 16:10:02'),
(88, 183, 'Reply: Tentang Perizinan (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nMaaf, syarat untuk lulus adalah maksimal tidak mengikuti 1 sesi. Jika terpaksa kontrol, bisa ijin tidak mengikuti, tapi hanya 1 sesi saja. Apakah dokter mengijinkan untuk mengikuti kegiatan kampus? Apabila keadaan tidak memungkinkan, saran dari kami bisa ikut untuk LKMM-TD di tahun depan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-12 21:02:33'),
(89, 184, 'Reply: Tentang binder (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nTidak ada ketentuan untuk isi binder. Nantinya binder akan diisi dengan modul materi LKMM-TD XXVII.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-12 21:06:45'),
(90, 186, 'Reply: Keplek (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nMengenai ukuran keplek yang benar mohon mengecek web kembali. Di web informasi mengenai keplek sudah jelas.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-13 11:14:42'),
(91, 187, 'Reply: shift (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nShift 2A dan shift 2B untuk membedakan pembagian shift rally games pada hari ke-4 pelaksanaan, yaitu tanggal 19 dan 24 Januari.', '2017-01-13 12:13:12'),
(92, 187, 'Reply: shift (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nShift 2A dan shift 2B untuk membedakan pembagian shift rally games pada hari ke-4 pelaksanaan, yaitu tanggal 19 dan 24 Januari.', '2017-01-13 12:14:01'),
(93, 188, 'Reply: masalah kesehatan (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTerima kasih atas konfirmasinya. Maaf, dalam LKMM-TD tidak diperbolehkan untuk ijin dengan alasan apapun. Untuk lulus LKMM-TD maksimal tidak mengikuti 1 sesi. Jika tidak memungkinkan untuk mengikuti, boleh tidak mengikuti LKMM-TD dan tahun depan mendaftar untuk mengikuti LKMM-TD 2018. Jika ada yang ingin dibicarakan lebih lanjut dapat melalui contact us ini saja.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 07:49:20'),
(94, 190, 'Reply: Mengenai Laptop (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nLaptop untuk setiap kelompok minimal 1. Jadi tidak masalah jika hanya ada 1 laptop dalam kelompok peserta.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 07:51:04'),
(95, 192, 'Reply: laptop (LKMM-TD XXVII)', 'Selamat siang,\r\n\r\nLebih baik jika laptop memiliki lubang HDMI, karena di beberapa sesi diperlukan untuk presentasi di kelas. \r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 07:53:03'),
(96, 193, 'Reply: pakaian (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nKemeja tidak harus seperti berkantong 1. Ketentuannya kemeja harus putih polos dan berlengan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 07:54:35'),
(97, 194, 'Reply: pertanyaan menyangkut barang bawaan (LKMM-T', 'Selamat pagi,\r\n\r\nKetentuan dari panitia slayer berwarna gelap. Bermotif atau tidak yang penting berwarna gelap. Harap lebih memperhatikan informasi-informasi yang ada di web.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 08:21:26'),
(98, 197, 'Reply: Pertanyaan format name tag (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nTidak ada format ukuran untuk ukuran kertas dan ukuran huruf. Yang penting kertas tidak terlalu kecil dan tulisan terlihat jelas.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 08:23:15'),
(99, 196, 'Reply: Pertanyaan mengenai benang wol (LKMM-TD XXV', 'Selamat pagi,\r\n\r\nJika tidak menemukan ukuran supermilco. Boleh membawa benang wol putih dengan ukuran yang lain.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 08:26:12'),
(100, 189, 'Reply: Benang wol (LKMM-TD XXVII)', 'Selamat pagi,\r\n\r\nJika tidak menemukan ukuran super milco. Boleh membawa benang wol putih dengan ukuran yang lain.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 08:26:50'),
(101, 185, 'Reply: Mengenai benang ukuran super milco (LKMM-TD', 'Selamat pagi,\r\n\r\nJika tidak menemukan ukuran supermilco. Boleh membawa benang wol putih dengan ukuran yang lain.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-14 08:27:31'),
(102, 198, 'Reply: Barang bawaan kelompok: jumlah laptop (LKMM', 'Selamat malam,\r\n\r\nMohon maaf, tetap seperti ketentuan setiap kelompok harus membawa minimal 2 buah laptop. Hal ini dikarenakan untuk memudahkan pengerjaan tugas kelompok kalian sendiri. Tolong diusahakan, misalnya dengan mencari pinjaman.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:37:59'),
(103, 199, 'Reply: Barang wajib Permen (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nPermen dibawa setiap hari. Kemasan boleh berbeda-beda.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:39:19'),
(104, 200, 'Reply: tempeh bambu (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nBoleh, dibawa saja.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:40:33'),
(105, 201, 'Reply: Pertanyaan (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nIya benar.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:44:41'),
(106, 203, 'Reply: tentang benang wol (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nBoleh membawa ukuran yang lain.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:45:19'),
(107, 205, 'Reply: Ketentuan barang optional (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nKetentuan dompet sesuai dengan yang ada di peraturan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:47:41'),
(108, 205, 'Reply: Ketentuan barang optional (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nKetentuan dompet sesuai dengan yang ada di peraturan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:48:05'),
(109, 205, 'Reply: Ketentuan barang optional (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nKetentuan dompet sesuai dengan yang ada di peraturan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:48:08'),
(110, 205, 'Reply: Ketentuan barang optional (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nKetentuan dompet sesuai dengan yang ada di peraturan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:48:08'),
(111, 205, 'Reply: Ketentuan barang optional (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nKetentuan dompet sesuai dengan yang ada di peraturan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 00:48:14'),
(112, 206, 'Reply: Ketentuan barang wajib (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nMohon maaf, tetapi sesuai peraturan lkmm-td, tidak diperbolehkan untuk membawa flashdisk yang ada aksesorisnya. Akan lebih baik apabila membawa flashdisk lain yang tidak ada aksesorisnya.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati', '2017-01-16 10:54:33'),
(113, 208, 'Reply: Barang Bawaan Kelompok (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nMohon maaf, tetapi sesuai peraturan LKMM-TD, setiap kelompok diwajibkan untuk membawa 2 buah laptop. Akan lebih baik apabila bisa meminjam milik teman lain jika benar-benar tidak ada anggota kelompok yang dapat membawa laptop lagi.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 10:58:12'),
(114, 209, 'Reply: Pertanyaan area dropzone (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nTidak ada ketentuan mengenai area dropoff dalam kegiatan LKMM-TD ini.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:01:23'),
(115, 210, 'Reply: Untuk Barang Bawaan (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nMengenai pertanyaan boleh tidaknya membawa Dual USB Drive , diperbolehkan untuk membawa Dual USB Drive jika memang benar-benar tidak memiliki flashdisk. Identitas memakai name tag juga diperbolehkan.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:05:16'),
(116, 211, 'Reply: pertanyaan seputar barang bawaan LKMM-TD (L', 'Selamat Siang\r\n\r\nSebelumnya, apakah harus diserahkan saat hari LKMM-TD? Jika dapat diserahkan pada hari lain selain hari kegiatan LKMM-TD maka akan jauh lebih baik jika diserahkan pada hari lain saja. Namun jika tidak dapat diserahkan pada hari lain, maka tidak apa-apa membawa berkas definitif namun harus diserahkan saat makan siang dan bukan selama sesi acara LKMM-TD berlangsung.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:19:13'),
(117, 212, 'Reply: Bertanya mengenai sepatu (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nDiperbolehkan untuk memakai sepattu berwarna selain warna hitam.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:21:36'),
(118, 213, 'Reply: jam kepulangan (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nJadwal shift 1A pada tanggal 19 Januari 2017 selesai sekitar pukul 13.15.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:23:48'),
(119, 214, 'Reply: kendaraan (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nSelama LKMM-TD diperbolehkan untuk membawa kendaraan sendiri. Barang-barang seperti KTP dan SIM diperbolehkan untuk dibawa selama LKMM-TD ini.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:29:25'),
(120, 218, 'Reply: Peraturan untuk Rambut Perempuan (LKMM-TD X', 'Selamat Siang\r\n\r\nDiperbolehkan untuk membawa dan memakai jepit rambut hitam polos. Akan lebih baik jika dijepit saja memakai jepit hitam polos.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:31:17'),
(121, 217, 'Reply: Bertanya (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nSelama kegiatan LKMM-TD berlangsung, diperbolehkan untuk membawa kendaraan pribadi. Mengenai parkir dapat ditentukan sendiri, dalam kawasan Universitas Kristen Petra atau sekitarnya.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:34:24'),
(122, 82, 'Reply: Akhir Acara LKMM TD (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nMengenai selesainya acara LKMM-TD ini setiap harinya sekitar pukul 18.00 WIB kecuali hari keempat dimana jam selesainya berbeda-beda tergantung shift yang didapat.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:37:42'),
(123, 83, 'Reply: Keplek (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nKeplek (buku acara) diprint sendiri dan dibuat sendiri. Tidak disediakan oleh panitia LKMM-TD.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:40:46'),
(124, 79, 'Reply: Tanya jadwal (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nSesuai pengumuman yang diberikan di web, acara dimulai pukul 07.00 WIB kecuali hari keempat dimana pada hari itu tergantung pada shift masing-masing. Informasi lebih lanjut dapat dilihat pada web LKMM-TD.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:42:39'),
(125, 207, 'Reply: Pertanyaan mengenai laptop (LKMM-TD XXVII)', 'Selamat Siang\r\n\r\nMohon maaf tetapi tidak diperbolehkan membawa kabel extender. Untuk presentasi, dapat meminjam laptop teman kelompok lain.\r\n\r\nTerima Kasih, Tuhan Yesus memberkati.', '2017-01-16 11:47:45'),
(126, 216, 'Reply: Pertanyaan tentang barang bawaan (LKMM-TD X', 'Selamat siang,\r\n\r\nSambungan kabel seperti apa ya? Mungkin bisa diberikan contohnya?\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 11:47:48'),
(127, 215, 'Reply: Name tag lemas dan tali kur (LKMM-TD XXVII)', 'Selama siang,\r\n\r\nKetentuan ukuran name tag dan warna tali kur sesuai dengan yang ada di web. Mohon membawa barang bawaan sesuai yang tertulis di web.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-16 11:49:09'),
(128, 219, 'Reply: Ijin kepulangan (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nMohon maaf syarat kelulusan LKMM-TD adalah maksimal tidak mengikuti 1 sesi. Ijin tidak diperkenankan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-17 00:40:44'),
(129, 219, 'Reply: Ijin kepulangan (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nMohon maaf syarat kelulusan LKMM-TD adalah maksimal tidak mengikuti 1 sesi. Ijin tidak diperkenankan.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-17 00:45:02'),
(130, 219, 'Reply: Ijin kepulangan (LKMM-TD XXVII)', 'Selamat malam,\n\nMohon maaf syarat kelulusan LKMM-TD adalah maksimal tidak mengikuti 1 sesi. Ijin tidak diperkenankan.\n\nTerima kasih, Tuhan memberkati.', '2017-01-17 00:45:10'),
(131, 221, 'Reply: mau bertanya soal kapas pembalut luka (rev)', 'Selamat malam,\r\n\r\nSesuai ketentuan, 1 pak.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n', '2017-01-17 22:31:23'),
(132, 1400, 'Reply: Tidak apat email eval  (LKMM-TD XXVII)', 'selamat malam,\r\nterima kasih atas konfirmasinya, link nya akan dikirim kembali.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-18 20:29:53'),
