(139, 220, 'Reply: mau bertanya soal kasa pembalut luka (LKMM-', 'Selamat malam,\r\n\r\nSesuai dengan ketentuan yang tertulis di web, membawa sebanyak 1 pak.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-18 21:02:12'),
(140, 1403, 'Reply: Seragam untuk tanggal 19 Januari 2017 (LKMM', 'Selamat malam,\r\n\r\nKetentuan seragam sama dengan hari-hari sebelumnya.\r\n\r\nTerima kasih, Tuhan memberkati. ', '2017-01-18 23:18:14'),
(141, 1424, 'Reply: Kehadiran (LKMM-TD XXVII)', 'Selamat malam\r\n\r\nMohon maaf sebelumnya, kemarin ada gangguan pada server sehingga beberapa data tidak tersimpan dengan benar. Sekarang sudah kami perbaiki. Dapat dilihat lagi pada student myboard anda.\r\n\r\nTerima kasih, Tuhan Yesus memberkati', '2017-01-19 21:51:59'),
(142, 1425, 'Reply: Kesalahan Data Catatan Kehadiran (LKMM-TD X', 'Selamat malam\r\n\r\nMohon maaf sebelumnya, kemarin ada gangguan pada server sehingga beberapa data tidak tersimpan dengan benar. Sekarang sudah kami perbaiki. Dapat dilihat lagi pada student myboard anda.\r\n\r\nTerima kasih, Tuhan Yesus memberkati', '2017-01-19 21:52:54'),
