(145, 1430, 'Reply: Kekurangan Anggota Lkmmtd (LKMM-TD XXVII)', 'Selamat malam\r\n\r\nMohon maaf tetapi data kelompok yang sudah dibuat tidak dapat diganti lagi.\r\n\r\nTerima kasih, Tuhan memberkati', '2017-01-19 21:56:32'),
(146, 1421, 'Reply: Pertanyaan (LKMM-TD XXVII)', 'Selamat malam\r\n\r\nSesuai peraturan LKMM-TD, tidak diperbolehkan untuk memakai aksesoris. Namun jika memang tidak dapat dilepas, maka dapat membuat surat izin yang nantinya diserahkan kepada panitia divisi keamanan.\r\n\r\nTerima kasih, Tuhan Yesus memberkati', '2017-01-19 22:02:02'),
(147, 1431, 'Reply: Flashdisk (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nBesar penyimpanan flashdisk bebas. Untuk nama, nrp, dan nama kelompok ditempel pada flashdisk.\r\n\r\nTerima kasih, Tuhan memberkati. ', '2017-01-19 23:08:52'),
(148, 1433, 'Reply: Perijinan berhalangan mengikuti LKMMTD (LKM', 'Selamat malam,\r\n\r\nJika tidak dapat mengikuti sesi di LKMM-TD tidak perlu membuat surat ijin, karena tetap akan dianggap tidak mengikuti sesi. Untuk syarat kelulusan LKMM-TD maksimal hanya tidak mengikuti 1 sesi. Jika memang peserta tidak memungkinkan mengikuti LKMM-TD tahun ini, peserta dapat mendaftar untuk mengikuti LKMM-TD tahun depan.\r\n\r\nTerima kasih, Tuhan memberkati.\r\n\r\nT', '2017-01-19 23:35:34'),
(149, 1442, 'Reply: Infraboard (LKMM-TD XXVII)', 'Selamat pagi\r\n\r\nTidak masalah jika ukuran infraboardnya lebih dari A2.\r\n\r\nTerima kasih, Tuhan memberkati', '2017-01-20 08:15:13'),
(150, 1449, 'Reply: agnesfloresita@gmail.com (LKMM-TD XXVII)', 'Selamat malam\r\n\r\nSilahkan coba lagi mengakses di student.petra.ac.id/my/board, login menggunakan alamat email john lengkap dengan @john.petra.ac.id dan password sim. Jika masih belum bisa dan tulisan yang keluar adalah token invalid maka itu sudah tersimpan datanya dan tidak perlu mengisi lagi.\r\n\r\nTerima kasih, Tuhan memberkati', '2017-01-20 19:47:33'),
(151, 1450, 'Reply: pertanyaan (LKMM-TD XXVII)', 'Selamat malam,\r\n\r\nTanggal 30 Januari sudah tidak ada kegiatan LKMM-TD.\r\n\r\nTerima kasih, Tuhan memberkati.', '2017-01-20 20:50:05'),
(152, 1453, 'Reply: Mohon tanggapan seputar status pengisian An', 'Selamat malam\r\n\r\nMemang status pengisian tidak berubah secara otomatis dan baru akan diganti nanti malam atau besok.\r\n\r\nTerima kasih, Tuhan memberkati', '2017-01-20 22:31:26'),
