tyle="text-align: center;">Teknik Informatika</td>\r\n<td style="text-align: center;">International Business Management</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">Sistem Informasi Bisnis</td>\r\n<td style="text-align: center;">Manajemen Kepariwisataan</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">Manajemen Perhotelan</td>\r\n<td style="text-align: center;">Manajemen Keuangan</td>\r\n</tr>\r\n</tbody>\r\n</table>', '2016-01-09 06:41:22', 1),
(9, 'PERATURAN PESERTA LKMM-TD XXVI', 'PERATURAN PESERTA LKMM-TD XXVI', '<p><strong>Pasal A </strong><strong>(Absensi)</strong></p>\r\n<ul>\r\n<li>Batas tidak mengikuti sesi maksimal 1x</li>\r\n<li>Batas keterlambatan 15 menit untuk setiap sesi/acara (Waktu LKMM-TD)</li>\r\n<li>Peserta wajib membawa KTM, KTM yang telah dibawa dimasukkan ke dalam kotak yang telah disediakan di setiap ruang kelas.</li>\r\n<li>Jika peserta terlambat lebih dari 15 menit atau tidak memasukkan KTM di kotak yang disediakan untuk setiap kelas maka peserta dianggap Absen atau tidak mengkiuti sesi.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Pasal B </strong><strong>(</strong><strong>Barang</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Peserta wajib membawa barang sesuai daftar yang telah ditentukan</li>\r\n<li>Peserta wajib bertanggung jawab terhadap barang bawaan masing - masing</li>\r\n<li>Peserta dilarang membawa permainan jenis apapun</li>\r\n<li>Barang yang tidak sesuai dengan ketentuan akan disita dan dikembalikan seusai acara</li>\r\n<li>Barang bawaan dimasukan dalam tas ransel (bukan handbag)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Pasal C </strong><strong>(</strong><strong>Kelancaran Acara</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Peserta wajib mengikuti seluruh rangkaian sesi dari awal sampai akhir</li>\r\n<li>Peserta wajib datang tepat waktu</li>\r\n<li>Peserta wajib meninggalkan tanda pengenal saat meninggalkan ruang sesi (Ke Toilet memberikan kartu toilet yang disediakan oleh fasilitator)</li>\r\n<li>Peserta dilarang melakukan aktivitas lain yang dapat mengganggu kelancaran acara</li>\r\n<li>Peserta hanya diperbolehkan menggunakan HP di luar sesi</li>\r\n<li>Peserta dilarang keluar tanpa ijin dari panitia</li>\r\n<li>Peserta dilarang tidur selama sesi berlangsung</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Pasal D </strong><strong>(</strong><strong>Penampilan</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Dilarang menggunakan aksesoris selain jam tangan</li>\r\n<li>Dilarang berkuku panjang dan berwarna</li>\r\n</ul>\r\n<p><u>PRIA</u></p>\r\n<ul>\r\n<li>Rambut rapi (Rambut belakang tidak mengenai kerah baju, Rambut bagian samping tidak menutupi telinga, Rambut bagian depan tidak melebihi alis mata)</li>\r\n</ul>\r\n<p><u>WANITA</u></p>\r\n<ul>\r\n<li>Rambut rapi diikat tunggal ke belakang (ikat rambut berwarna hitam)</li>\r\n<li>Rambut bagian depan tidak melebihi alis (bila melebihi diikat kebelakang)</li>\r\n<li>Make up yang diperbolehkan hanya bedak, pensil alis dan lipbalm</li>\r\n<li>Boleh menggunakan anting-anting</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Pasal E </strong><strong>(</strong><strong>Pakaian</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Wajib memakai pakaian standard LKMM-TD (Jas Almamater + Kemeja Putih <strong><u>polos</u></strong> dengan kerah standar + Celana Panjang hitam kain katun).</li>\r\n<li>Kemeja putih yang berlogo maksimal berukuran 4x2 cm</li>\r\n<li>Kancing baju maksimal terbuka 1 dari atas</li>\r\n<li>Wajib memakai dan memperlakukan jas almamater dengan baik dan benar (dikancing dan tidak dilinting/dilipat).</li>\r\n<li>Menggunakan Pin Fakultas dengan baik dan benar</li>\r\n<li>Baju tidak melebihi almamater</li>\r\n<li>Kemeja putih dengan lengan panjang dilinting, sedangkan kemeja putih dengan lengan pendek tidak diperbolehkan dilinting/dilipat</li>\r\n<li>Pakaian tidak ketat dan tidak tembus pandang</li>\r\n<li>Hanya boleh memakai baju dalam dengan warna senada</li>\r\n<li>Wajib memakai celana panjang hitam yang berbahan kain katun</li>\r\n<li>Ikat pinggang standar (besar gesper normal berwarna hitam/cokelat)</li>\r\n<li>Wajib menggunakan sepatu tertutup (sneakers/kets)</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p><strong>Pasal F&nbsp;</strong><strong>(</strong><strong>Berbicara</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Peserta wajib menghargai, menghormati dan bersikap kooperatif dengan semua pihak yang terlibat dalam pelaksanaan LKMM-TD XXVI.</li>\r\n<li>Peserta wajib menggunakan bahasa yang baik dan benar (tidak berbicara kotor)</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Pasal G&nbsp;</strong><strong>(</strong><strong>Kebersihan</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Peserta wajib menjaga kebersihan area LKMM-TD</li>\r\n<li>Peserta tidak boleh meludah sembarangan</li>\r\n<li>Peserta tidak diperbolehkan merusak fasilitas kampus</li>\r\n<li>Peserta wajib menjaga dan memelihara properti di area LKMM-TD</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Pasal H&nbsp;</strong><strong>(</strong><strong>Koordinasi Panitia</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Dapat berkoordinasi dengan panitia (mendengarkan arahan yang diberikan)</li>\r\n<li>Peserta wajib memanggil panitia dengan sebutan &ldquo;kak&rdquo;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Pasal I&nbsp;</strong><strong>(</strong><strong>Anarkis</strong><strong>)</strong></p>\r\n<ul>\r\n<li>Peserta dilarang membawa NAPZA, miras, rokok dan senjata tajam</li>\r\n<li>Peserta dilarang berkelahi, berjudi, mencuri dan berbuat asusila</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><u>CONTOH KARET RAMBUT DAN JEPIT YANG DIPERBOLEHKAN</u></p>\r\n<p><u><img src="../img/karet dan jepit yang diperbolehkan.jpg" alt="" width="441" height="220" /></u></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><u>CONTOH SEPATU YANG DIPERBOLEHKAN</u></p>\r\n<p>&nbsp;<img src="../img/sepatu yang diperbolehkan.jpg" alt="" width="421" height="454" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><u>CONTOH BAJU YANG DIPERBOLEHKAN</u></p>\r\n<p>&nbsp;</p>\r\n<p><img src="../img/kemeja putih lengan panjang.jpg" alt="" width="307" height="342" /><img src="../img/kemeja putih lengan pendek.jpg" alt="" width="362" height="382" /></p>\r\n<p><img src="../img/kemeja putih bermotif salah.jpg" alt="" width="318" height="413" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><u>CONTOH CELANA HITAM KAIN KATUN YANG BENAR</u></p>\r\n<p><u><img src="../img/celana katun hitam yang benar.jpg" alt="" width="202" height="266" /></u></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2016-01-11 12:24:12', 1),
(10, 'Ruang Kelas Untuk LKMM-TD', 'Ruang Kelas Diubah', '<h4>Ruangan kelas untuk LKMM-TD XXVI mengalami perubahan. Perubahan kelas akan segera di update. Kami mohon kepada peserta LKMM-TD XXVI untuk bisa melihat kelas masing-masing. Terima kasih.</h4>', '2016-01-13 16:15:25', 0),
(12, 'Perubahan Ukuran Plastik Untuk Buku Acara', 'Plastik Buku Acara', '<h4>Plastik yang digunakan untuk memasukkan buku acara berukuran 11,5x19,5 cm.</h4>', '2016-01-16 06:40:58', 1),
(14, 'PERUBAHAN KELOMPOK DAN RUANG KELAS', 'PERUBAHAN KELOMPOK DAN RUANG KELAS', '<h4>Ada perubahan pembagian kelompok dan kelas. \r\n<br>Seluruh peserta LKMM-TD XXVI dimohon untuk mengecek kembali anggota kelompok dan ruang kelasnya. Terima kasih.</h4>', '2016-01-17 04:47:28', 1),
(15, 'Barang Bawaan Wajib Kelompok  Hari Kedua', 'Bawaan Tambahan', '<p>Setiap kelompok wajib membawa 1 buah lem kertas.</p>', '2016-01-19 12:24:26', 1),
(16, 'Perubahan Kelompok Rally Shift 2', 'Perubahan Kelompok Rally Shift 2', '<p>Pengumuman perubahan kelompok rally shift 2:<br /> Ada perubahan kelompok rally shift 2. Peserta LKMM-TD shift 2 diharap untuk mengecek kembali kelompok rallynya. Terima kasih</p>', '2016-01-20 16:43:06', 1),
(17, 'Waktu Kumpul Peserta LKMM-TD Shift 1', 'Untuk para peserta LKMM-TD shift 1 harap hadir 15 menit sebelum acara dimulai dan langsung menuju ke tempat masing-masing. Shift 1A (Auditorium), Shift 1B (AVT). Terimakasih', '<h4>Untuk para peserta LKMM-TD shift 1 harap hadir 15 menit sebelum acara dimulai dan langsung menuju ke tempat masing-masing. <br>Tidak ada titik kumpul. Shift 1A (Auditorium), Shift 1B (AVT). Terimakasih</h4>', '2016-01-21 10:04:15', 0),
(19, 'Waktu Kumpul Peserta LKMM-TD Shift 2', 'Waktu Kumpul Peserta LKMM-TD Shift 2', '<h4>Untuk para peserta LKMM-TD shift 2 harap hadir 15 menit sebelum acara dimulai dan langsung menuju ke tempat masing-masing. <br>Tidak ada titik kumpul. Shift 2A (Auditorium), Shift 2B (AVT). Terimakasih</h4>', '2016-01-24 11:53:31', 1),
