(21, 'Ketentuan Pengisian Post-Test & Angket Umpan Balik', 'Ketentuan Pengisian Post-Test dan Angket Umpan Balik', '<p><strong><em>POST-TEST</em></strong><strong> DAN ANGKET UMPAN BALIK</strong></p>\r\n<p>Ketentuan Pengisian:</p>\r\n<ol>\r\n<li><em>Linkposttest</em> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :<strong>gl/O5RZRA </strong>(huruf O)</li>\r\n</ol>\r\n<p align="left">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Link</em> angket umpan balik&nbsp;&nbsp;&nbsp; :<strong>goo.gl/Yi97Yh</strong></p>\r\n<ol start="2">\r\n<li><em>Login</em> menggunakan m+nrp (contoh: m32415001);<em>password</em> sesuai dengan yang digunakan untuk login di sim.petra.ac.id</li>\r\n<li>Angket <em>posttest</em> dan umpan balik akan dibuka pada pukul 18.00, batas pengisian sampai pukul 23.59 (diingatkan ke mahasiswa untuk TIDAK mengisi diluar jam tersebut untuk</li>\r\n<li>Disarankan membuka dan mengisi angket menggunakan <em>chrome / mozilla</em></li>\r\n<li>Setelah membuka <em>link </em>HARUS langsung diisi</li>\r\n<li>Setelah mengisi, JANGAN ditekan tombol <em>back</em> untuk mencegah <em>error </em></li>\r\n<li>Angket WAJIB diisi untuk dapat melihat status kelulusan</li>\r\n</ol>\r\n<p><em>Link</em> status kelulusan : <strong>http://student.petra.ac.id:90/myboard/</strong></p>\r\n<p>Halaman tersebut digunakan untuk mengkonfirmasi pengisian angket <em>pretest, posttest, </em>umpan balik, dan evaluasi BEM, melihat presensi kehadiran, serta melihat status kelulusan untuk memproses SKKK peserta (sebagai salah satu syarat wisuda)</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2016-01-25 13:06:27', 0),
(22, 'Barang Bawaan Hari Keempat', 'Barang Bawaan Hari Keempat', '<p>Untuk hari ke-4 LKMM-TD XXVI, peserta tidak perlu membawa barang bawaan wajib kelompok. Peserta hanya diwajibkan membawa barang bawaan wajib inividu. Peserta tetap mengenakan pakaian standar LKMM-TD XXVI.</p>\r\n<p>Terima kasih.</p>', '2016-01-29 13:19:59', 1),
(23, 'Kehilangan Barang Peserta', 'Barang hilang peserta', '<p>Bagi peserta yang kehilangan barang dapat menghubungi</p>\r\n<p>(Nathanael Adi - 0821 8710 9551)</p>', '2016-01-27 00:06:52', 1),
(25, 'Pengumuman Untuk Peserta LKMM-TD Shift 1', 'Pengumuman Untuk Peserta LKMM-TD Shift 1', '<p>Mohon diperhatikan untuk angket evaluasi yang diumumkan saat closing karena pengisian diperpanjang sampai tanggal 2 Februari. Jangan lupa untuk diisi karena diperlukan untuk memproses SKKK.</p>', '2016-01-27 01:18:54', 1),
(26, 'Post-Test dan Angket Umpan Balik', 'POST-TEST DAN ANGKET UMPAN BALIK', '<p><strong><em>POST-TEST</em></strong><strong> DAN ANGKET UMPAN BALIK</strong></p>\r\n<p>Ketentuan Pengisian:</p>\r\n<ol>\r\n<li><em>Link</em> <em>posttest</em> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : <strong>goo.gl/Av3XC8</strong></li>\r\n</ol>\r\n<p><em>Link</em> angket umpan balik : <strong>goo.gl/SxqmnZ</strong></p>\r\n<ol start="2">\r\n<li><em>Login</em> menggunakan m+nrp (contoh: m32415001); <em>password</em> sesuai dengan yang digunakan untuk login di sim.petra.ac.id</li>\r\n<li>Angket <em>posttest</em> dan umpan balik akan <strong><u>dibuka pada pukul 18.00, batas pengisian sampai pukul 23.59</u></strong> (diingatkan ke mahasiswa untuk TIDAK mengisi diluar jam tersebut karena data tidak dapat diproses dan TIDAK ADA TOLERANSI mengenai keterlambatan pengisian)</li>\r\n<li>Disarankan membuka dan mengisi angket menggunakan <em>chrome / mozilla</em></li>\r\n<li>Setelah membuka <em>link </em>HARUS langsung diisi</li>\r\n<li>Setelah mengisi, JANGAN ditekan tombol <em>back</em> untuk mencegah <em>error </em></li>\r\n<li>Angket WAJIB diisi untuk dapat melihat status kelulusan</li>\r\n</ol>\r\n<p><em>Link</em> status kelulusan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : <strong>http://student.petra.ac.id:90/myboard/</strong></p>\r\n<p>Halaman tersebut digunakan untuk mengkonfirmasi pengisian angket <em>pretest, posttest, </em>umpan balik, dan evaluasi BEM, melihat presensi kehadiran, serta melihat status kelulusan untuk memproses SKKK peserta (sebagai salah satu syarat wisuda)</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2016-01-29 06:55:14', 1),
