(29, 'Info Untuk Hari Ke-4', 'Info Untuk Hari Ke-4', '<p>Untuk hari keempat LKMM-TD XXVI, peserta tidak perlu membawa barang bawaan wajib kelompok. Peserta hanya diwajibkan membawa barang bawaan wajib individu dan payung. Terima kasih.</p>', '2016-01-29 16:13:53', 1),
(30, 'ANGKET EVALUASI', 'Ketentuan Pengisian Angket Evaluasi Shift 2', '<p>Ketentuan Pengisian:</p>\r\n<ol>\r\n<li><em>Link</em> angket evaluasi: <strong>http://goo.gl/HXIUvx</strong></li>\r\n<li><em>Login</em> menggunakan m+nrp (contoh: m32415001); <em>password</em> sesuai dengan yang digunakan untuk <em>login</em> di sim.petra.ac.id</li>\r\n<li>Angket evaluasi akan <strong><u>dibuka pada pukul 18.00, batas pengisian sampai tanggal 6 Februari pukul 23.59</u></strong> (diingatkan ke mahasiswa untuk TIDAK mengisi diluar jam tersebut karena data tidak dapat diproses dan TIDAK ADA TOLERANSI mengenai keterlambatan pengisian)</li>\r\n<li>Disarankan membuka dan mengisi angket menggunakan <em>chrome / mozilla</em></li>\r\n<li>Setelah membuka <em>link</em> HARUS langsung diisi</li>\r\n<li>Setelah mengisi, JANGAN ditekan tombol <em>back</em> untuk mencegah <em>error</em></li>\r\n<li>Angket WAJIB diisi untuk dapat melihat status kelulusan</li>\r\n</ol>\r\n<p><em>Link</em> status kelulusan: <strong>http://student.petra.ac.id:90/myboard/</strong></p>\r\n<p>Halaman tersebut digunakan untuk mengkonfirmasi pengisian angket <em>pretest, posttest</em>, umpan balik, dan evaluasi BEM, melihat presensi kehadiran, serta melihat status kelulusan untuk memproses SKKK peserta (sebagai salah satu syarat wisuda)</p>', '2016-01-30 13:58:14', 1);
